INSERT INTO `brands` (`id`, `title_fa`, `title_en`, `slug`, `image`, `seo_title`, `seo_description`, `description`, `created_at`, `updated_at`) VALUES
(2, 'آدیداس', 'Adidas', 'Adidas', 'bqqKCpmfqJ_brand_adidas.jpg', 'خرید و قیمت کفش برند آدیداس: جدیدترین مدل‌های کفش آدیداس با کیفیت و متنوع برای خرید آنلاین', 'برند کفش آدیداس (Adidas) ترکیبی از استایل و تکنولوژی. برند کفش آدیداس به عنوان یکی از برندهای پیشوایانه در دنیای کفش ورزشی و استریت ویر معروف است. این برند با تاریخچه‌ای بلند از تولید کفش‌های...', '<h1>برند کفش آدیداس (Adidas) - استایل، عملکرد و تاریخچه جهانی</h1><h3>برند کفش آدیداس (Adidas) یکی از برترین و معروف‌ترین نام‌ها در دنیای کفش‌های ورزشی و استایلی است. این برند با  تمرکز بر تولید کفش‌هایی با طراحی استثنایی و عملکرد برتر دارد که توسط ورزشکاران حرفه‌ای و افرادی که به دنبال استایل و کیفیت هستند، مورد ترجیح قرار می‌گیرد. </h3><h2>استایل:</h2><h5>کفش‌های آدیداس با طراحی‌های مدرن و شیک، امکان به رخ کشیدن استایل خاصی را فراهم می‌کنند. این کفش‌ها برای مصرف روزمره و همچنین برای مواقع ویژه مثل ورزش و تمرینات ورزشی بسیار مناسب هستند.</h5><h2>عملکرد:</h2><h5>آدیداس به عنوان نمادی از کیفیت و عملکرد برتر در کفش‌های ورزشی شناخته می‌شود. این کفش‌ها توسط ورزشکاران حرفه‌ای و تیم‌های ورزشی برتر در جهان استفاده می‌شوند.</h5><h2>تاریخچه جهانی:</h2><h5>آدیداس با تاریخچه‌ای بسیار طولانی و جهانی، به عنوان یکی از بزرگترین و قدرتمندترین برندهای کفش در دنیا شناخته می‌شود. این برند تاریخچه‌ای پر از دستاوردها و ابتکارات در صنعت کفش دارد.</h5><h3>کفش‌های آدیداس با تمرکز بر استایل، عملکرد، و تاریخچه جهانی، برای افرادی که به دنبال کفش‌های با کیفیت و استایل منحصر به فرد هستند، یکی از برندهای مورد اعتماد است. این کفش‌ها با طراحی‌های متنوع و کیفیت عالی به شما امکان می‌دهند تا به بهترین شکل ممکن در ورزش و در زندگی روزمره‌تان عمل کنید.</h3>', '2022-11-27 06:14:15', '2023-09-05 16:46:35'),
(3, 'جردن', '‌‌jordan', '‌‌jordan', 'SnyF5hybZS_brand_jordan.jpg', 'خرید و قیمت کفش برند جردن: جدیدترین مدل‌های کفش جردن با کیفیت و متنوع برای خرید آنلاین', 'برند کفش جردن (‌‌jordan) جلوه‌ای از شیاق و ذوق. برند کفش جردن با تاریخچه‌ای ستودنی در دنیای کفش‌سازی، به عنوان یکی از نام‌های پرطرفدار و مورد علاقه معرفی می‌شود. ما در جردن به ایجاد کفش‌هایی...', '<h1>برند کفش جردن (Jordan) - استایل، ورزش و شهریت جهانی</h1><h3>برند کفش جردن (Jordan) به عنوان یکی از برترین و معروفترین برندهای کفش ورزشی در جهان شناخته می‌شود. این برند با استفاده از کلمات کلیدی سئو در توضیحات خود، تمرکز بر تولید کفش‌های استایلی و ورزشی با کیفیت عالی دارد که توسط ورزشکاران حرفه‌ای و افرادی که به دنبال استایل خاصی هستند، ترجیح می‌دهند.</h3><h2>استایل:</h2><h5>کفش‌های جردن با طراحی‌های جذاب و مدرن، امکان به رخ کشیدن استایل شیک و متفاوتی را فراهم می‌کنند. این کفش‌ها نه تنها برای ورزش بلکه برای استفاده روزمره نیز مناسب هستند.</h5><h2>ورزش:</h2><h5>برند جردن به عنوان نمادی از عملکرد برتر و کیفیت در ورزش‌های مختلف شناخته می‌شود. کفش‌های جردن مورد تأیید ورزشکاران حرفه‌ای و بازیکنان برتر در جهان می‌باشند.</h5><h2>شهریت جهانی:</h2><h5>نام جردن به سرعت به شهرت جهانی دست یافته و برای افرادی که به دنبال برندهای معروف هستند، جذابیت دارد.</h5><h3>کفش‌های جردن با تمرکز بر استایل، ورزش، و شهریت جهانی، یکی از برندهای مورد ترجیح برای افرادی هستند که به دنبال کفش‌های با کیفیت و استایلی منحصر به فرد هستند. این کفش‌ها با طراحی‌های متنوع و با کیفیت عالی به شما امکان می‌دهند تا به بهترین شکل ممکن در ورزش و به روزمره خود عمل کنید.به فروشگاه آنلاین کفش اف دی استایل خوش آمدید.</h3>', '2022-11-27 06:15:00', '2023-09-05 16:44:39'),
(4, 'نیو بالانس', 'New Balance', 'new-balance', 'FqaUOhkp27_brand_new_balance.jpg', 'خرید و قیمت کفش نیو بالانس: جدیدترین مدل‌های کفش نیو بالانس با کیفیت و متنوع برای خرید آنلاین', 'برند کفش نیو بالانس (New Balance) ترکیبی از سبک و کیفیت. برند نیو بالانس با تاریخچه‌ای ممتاز در دنیای کفش‌سازی، به عنوان یکی از پیشوایان در تولید کفش‌های با کیفیت و طراحی متنوع مشهور است...', '<h1>برند کفش نیو بالانس (New Balance) - سهمیه ورزشی، راحتی و کیفیت</h1><h3>برند کفش نیو بالانس (New Balance) یکی از برندهای معروف و محبوب در دنیای کفش‌های ورزشی و کفش‌های راحتی است. این برند با استفاده از کلمات کلیدی سئو در توضیحات خود، تمرکز بر تولید کفش‌های با کیفیت بالا و راحتی برای مشتریان دارد.</h3><h2>سهمیه ورزشی:</h2><h5>کفش نیو بالانس به عنوان نمادی از سهمیه ورزشی در بازار شناخته می‌شوند. این کفش‌ها برای ورزشکاران و علاقه‌مندان به ورزش به دلیل کیفیت بالا و عملکرد برترشان جذابیت دارند.</h5><h2>راحتی:</h2><h5>نیو بالانس بر راحتی در هنگام پوشیدن کفش تأکید دارد. طراحی‌های منحصر به فرد و فناوری‌های پیشرفته در این کفش‌ها به شما تجربه راحتی بی‌نظیری می‌دهند.</h5><h2>کیفیت بالا:</h2><h5>کفش نیو بالانس با مواد با کیفیت بالا ساخته می‌شوند و به دوام بالایی دارند. این برند از تکنولوژی‌های پیشرفته برای تولید کفش‌های با کیفیت و با دوام استفاده می‌کند.</h5><h3>نیو بالانس با تمرکز بر سهمیه ورزشی، راحتی، و کیفیت بالا، یکی از برندهای مورد اعتماد برای افرادی است که به دنبال کفش‌های با کیفیت و راحتی بی‌نظیر هستند. این کفش‌ها با طراحی‌های متنوع و مواد با کیفیت بالا به شما امکان می‌دهند تا در ورزش و فعالیت‌های روزمره‌تان به بهترین شکل ممکن عمل کنید.به فروشگاه اینترنتی کفش اف دی استایل خوش آمدید.</h3>', '2022-11-27 06:15:33', '2023-09-16 06:54:04'),
(5, 'نایکی', 'Nike', 'Nike', 'wGcPHaPOdf_brand_nike.jpg', 'خرید و قیمت کفش برند نایکی: جدیدترین مدل‌های کفش نایکی با کیفیت و متنوع برای خرید آنلاین', '\"برند کفش نایکی (Nike) نمایانگر استایل و عملکرد. برند نایکی به عنوان یکی از بزرگترین و معتبرترین نام‌ها در دنیای کفش ورزشی و استریت ویر مشهور است. این برند با تاریخچه‌ای حرفه‌ای و تکنولوژی‌های نوآورانه..', '<h1>برند کفش نایکی (Nike) - ابتکار، عملکرد برتر و استایل مدرن</h1><h3>برند کفش نایکی (Nike) به عنوان یکی از معتبرترین و محبوبترین برندهای کفش‌های ورزشی و استایل در جهان شناخته می‌شود. این برند با استفاده از کلمات کلیدی سئو در توضیحات خود، سعی دارد تا در جستجوی اینترنتی برای محصولات و خدمات خود به جلب توجه مشتریان بپردازد و مکملی برای افرادی باشد که به دنبال کفش‌های با کیفیت و استایلی منحصر به فرد هستند.</h3><h2> ابتکار و نوآوری:</h2><h5>کفش‌های نایکی به عنوان نمادی از ابتکار و نوآوری در صنعت کفش شناخته می‌شوند. این برند به مدل‌ها و فناوری‌های جدید متکی است تا به افراد امکان دهد در هر ورزش و فعالیتی به بهترین شکل ممکن عمل کنند.</h5><h2>عملکرد برتر:</h2><h5>کفش‌های نایکی با تمرکز بر عملکرد برتر و کیفیت بالا، انتخابی عالی برای افرادی هستند که به دنبال بهبود عملکرد و اجرای بهتر در ورزش‌ها و فعالیت‌های روزمره خود هستند.</h5><h2>استایل مدرن:</h2><h5>نایکی نیز توجه به استایل مدرن دارد. طراحی‌های زیبا و جذاب این کفش‌ها به شما امکان می‌دهند تا با استایلی شیک و جذاب به نمایش بگذارید.</h5><h2>متنوعیت محصولات:</h2><h5>نایکی محصولات متنوعی در دسته‌های مختلف ارائه می‌دهد. از کفش‌های ورزشی گرفته تا کفش‌های کژوال و حتی کفش‌های مخصوص ورزش‌های خاص، شما می‌توانید کفشی را انتخاب کنید که به نیازهای ورزشی یا روزمره‌تان بیشتر مناسب باشد.</h5><h3>کفش‌های نایکی با تمرکز بر ابتکار، عملکرد برتر، و استایل مدرن، انتخاب عالی برای افرادی هستند که به دنبال کفش‌های با کیفیت و استایلی منحصر به فرد هستند. این کفش‌ها با طراحی‌های متنوع و فناوری‌های برجسته به شما امکان می‌دهند تا به بهترین شکل ممکن در هر فعالیتی شرکت کنید.به فروشگاه اینترنتی کفش اف دی استایل خوش آمدید.</h3>', '2022-11-27 06:16:01', '2023-09-05 16:38:02'),
