INSERT INTO `categories` (`id`, `title_fa`, `title_en`, `slug`, `image`, `seo_title`, `seo_description`, `description`, `parent_id`, `variant_id`, `attribute_group_id`, `merchant_commission`, `created_at`, `updated_at`) VALUES
(1, 'مردانه', 'Men\'s', 'mens', NULL, 'خرید آنلاین محصولات مردانه: جدیدترین مدل‌های کفش با کیفیت بالا و تنوع بی‌پایان', 'باشکوه ترین تجربه خرید کفش مردانه را تجربه کنید! محصولات متنوع و با کیفیت برای آقایان با سلیقه‌های مختلف. از کفش‌های روزمره و رسمی تا اسپرت و ورزشی، از ما بخواهید. انتخاب ایده‌آل برای آقایان با سلیقه...', '<h3><strong>معرفی محصولات مردانه با کفش‌های با کیفیت عالی و تنوع فوق‌العاده</strong></h3><h4>به فروشگاه کفش اف دی استایل خوش آمدید، جایی که عشق به مد و استایل مردانه شکوفا می‌شود. ما به عنوان یکی از پیشروهای فروش کفش مردانه با کیفیت در بازار، با افتخار به شما ارائه می‌دهیم:</h4><h5><strong>کفش‌های مردانه با کیفیت عالی:</strong></h5><h6>در فروشگاه اف دی استایل ، شما می‌توانید انواع کفش‌های مردانه با کیفیت بالا را پیدا کنید. از کفش‌های رسمی و اداری تا کفش‌های اسپرت و ورزشی، ما محصولاتی با کیفیت برای همه سلیقه‌ها ارائه می‌دهیم.</h6><h5><strong>تنوع بی‌پایان:</strong></h5><h6>تنوع محصولات ما واقعاً بی‌پایان است. آیا به دنبال کفش‌های رسمی برای مراسم خاصی هستید؟ یا شاید کفش‌های اسپرت برای ورزش و تفریح؟ مهم نیست که سلیقه‌ی شما چیست، ما دارای گزینه‌هایی برای همه‌ی فصول و مناسبت‌ها هستیم.</h6><h5><strong>خرید آنلاین آسان:</strong></h5><h6>با <strong>اف دی استایل</strong> ، خرید کفش مردانه به یک تجربه آسان تبدیل شده است. شما می‌توانید به سرعت و راحت از خانه یا محل کار خود به ما سفارش دهید و محصول مورد نظر خود را درب منزل تحویل بگیرید.</h6><h5><strong>تخفیفات و پیشنهادات ویژه:</strong></h5><h6>ما به شما تخفیفات و پیشنهادات ویژه را ارائه می‌دهیم تا خرید کفش‌های مردانه با کیفیت را با صرفه‌جویی بیشتری انجام دهید. در وب‌سایت اف دی استایل ، شما می‌توانید به تخفیفات فصلی و محصولات تخصصی دسترسی داشته باشید.</h6><h5><strong>به روز رسانی مدل‌ها:</strong></h5><h6>ما به روزترین مدل‌های کفش مردانه را با دقت برای شما انتخاب می‌کنیم. با اف دی استایل، همیشه در مد روز باشید و استایل خود را بهبود دهید.</h6>', NULL, 2, 1, 0.00, '2022-11-26 19:58:27', '2023-09-06 08:45:24'),
(2, 'زنانه', 'Women\'s', 'womens', NULL, 'خرید آنلاین کفش زنانه: جدیدترین مدل‌های کفش با بهترین کیفیت', 'باشکوه ترین تجربه خرید کفش زنانه را تجربه کنید! محصولات متنوع و با کیفیت برای بانوان با سلیقه‌های مختلف. از کفش‌های روزمره و رسمی تا اسپرت و ورزشی، از ما بخواهید. انتخاب ایده‌آل برای خانم های با سلیقه..', '<h3>باشکوه ترین محصولات زنانه با کفش‌های شیک و مدرن را در اینجا پیدا کنید!</h3><h4>با ورود به دنیای مد و استایل زنانه در فروشگاه اف دی استایل ، شما به دنیایی از زیبایی و راحتی خوش آمدید. ما با افتخار به شما ارائه می‌دهیم.</h4><h4><strong>کفش‌های زنانه با کیفیت عالی:</strong> در اف دی استایل، شما می‌توانید انواع کفش‌های زنانه با کیفیت عالی را کشف کنید. از کفش‌های رسمی و اداری تا کفش‌های اسپرت و ورزشی، ما دارای گزینه‌هایی برای تمامی طراحی‌ها و ذوق‌ها هستیم.</h4><h5><strong>تنوع بی‌پایان:</strong></h5><h6>تنوع محصولات ما واقعاً بی‌پایان است. آیا به دنبال کفش‌های راحت برای روزمره هستید؟ یا شاید کفش‌های شیک برای مهمانی یا مراسم خاصی؟ همه‌ی اینها و بیشتر را در فروشگاه اینترنتی اف دی استایل پیدا خواهید کرد.</h6><h5><strong>خرید آنلاین آسان:</strong></h5><h6>ما تجربه خرید آنلاین را بسیار ساده کرده‌ایم. شما می‌توانید به سرعت و راحت از خانه یا محل کار خود به ما سفارش دهید و محصول مورد نظر خود را با اطمینان تحویل بگیرید.</h6><h5><strong>تخفیفات و پیشنهادات ویژه:</strong></h5><h6>ما به شما تخفیفات و پیشنهادات ویژه را ارائه می‌دهیم تا خرید کفش‌های زنانه با کیفیت را با صرفه‌جویی بیشتری انجام دهید. در وب‌سایت اف دی استایل، شما می‌توانید به تخفیفات فصلی و محصولات تخصصی دسترسی داشته باشید.</h6><h5><strong>به روز رسانی مدل‌ها:</strong></h5><h6>ما به روزترین مدل‌های کفش‌های زنانه را با دقت برای شما انتخاب می‌کنیم. با ما، همیشه در مد روز باشید و استایل خود را بهبود دهید.</h6><h4>با ورود به دنیای فشن و زیبایی زنانه در وب‌سایت ما، شما خواهید دید که خرید کفش زنانه با کیفیت و مدرن چقدر ساده و لذت‌بخش است. از انتخاب محصولات تا تحویل آسان، ما همیشه در خدمت شما هستیم تا تجربه‌ی خرید شما به یک تجربه بی‌نظیر تبدیل شود.</h4>', NULL, 2, 1, 0.00, '2022-11-27 06:33:02', '2023-09-11 06:10:03'),
(3, 'کفش مردانه', 'men\'s shoes', 'men-shoes', NULL, 'کفش مردانه با کیفیت و تنوع عالی - خرید آنلاین از فروشگاه اف دی استایل', 'کفش مردانه با کیفیت عالی و تنوع بی‌نظیر در فروشگاه اف دی استایل. انتخاب ایده‌آل برای آقایان با سلیقه. با ما همیشه در مد روز باشید. خرید آنلاین با تخفیفات ویژه...', '<h3>کفش مردانه با کیفیت و تنوع عالی خرید اینترنتی از فروشگاه اف دی استایل</h3><h4>باشکوه‌ترین مجموعه کفش مردانه با کیفیت عالی را در فروشگاه اف دی استایل کشف کنید. اف دی استایل با افتخار به شما ارائه می‌دهد.</h4><h5><strong>کفش‌های مردانه با کیفیت عالی:</strong></h5><h6>در وب‌سایت اف دی استایل، ما با افتخار یکی از بزرگ‌ترین مجموعه‌های کفش مردانه با کیفیت عالی را به شما ارائه می‌دهیم. از کفش‌های رسمی و اداری تا کفش‌های اسپرت و ورزشی، محصولات ما تضمینی برای سلیقه‌های مختلف هستند.</h6><h5><strong>تنوع بی‌پایان:</strong></h5><h6>تنوع محصولات ما واقعاً بی‌پایان است. آیا به دنبال کفش‌های رسمی برای مراسم خاصی هستید؟ یا کفش‌های راحت برای استفاده روزمره؟ ما دارای گزینه‌هایی برای هر سلیقه‌ای هستیم.</h6><h5><strong>خرید آنلاین آسان:</strong></h5><h6>فروشگاه کفش اف دی استایل تجربه خرید آنلاین را برای شما بسیار ساده کرده است. شما می‌توانید به سرعت و راحت از خانه یا محل کار خود به ما سفارش دهید و محصول مورد نظر خود را با اطمینان تحویل بگیرید.</h6><h5><strong>تخفیفات و پیشنهادات ویژه:</strong></h5><h6>ما به شما تخفیفات و پیشنهادات ویژه را ارائه می‌دهیم تا خرید کفش‌های مردانه با کیفیت را با صرفه‌جویی بیشتری انجام دهید. در فروشگاه اینترنتی اف دی استایل، شما می‌توانید به تخفیفات فصلی و محصولات تخصصی دسترسی داشته باشید.</h6><h5><strong>به روز رسانی مدل‌ها:</strong></h5><h6>ما به روزترین مدل‌های کفش‌های مردانه را با دقت برای شما انتخاب می‌کنیم. با ما، همیشه در مد روز باشید و استایل خود را بهبود دهید.</h6><h4>با ورود به دنیای کفش مردانه در فروشگاه اینترنتی اف دی استایل، شما خواهید دید که خرید کفش با کیفیت چقدر ساده و لذت‌بخش است. به ما بپیوندید و تجربه‌ی خرید بی‌نظیری را تجربه کنید.</h4>', 1, 2, 1, 0.00, '2022-11-27 07:34:47', '2023-09-06 08:45:57'),
(4, 'کفش روزمره مردانه', 'men\'s casual shoes', 'mens-casual-shoes', NULL, 'کفش روزمره مردانه با کیفیت و تنوع عالی - خرید آنلاین از فروشگاه اف دی استایل', 'کفش روزمره مردانه با کیفیت عالی و تنوع بی‌نظیر در فروشگاه اف دی استایل. انتخاب ایده‌آل برای آقایان با سلیقه. با ما همیشه در مد روز باشید. خرید آنلاین با تخفیفات ویژه...', '<h4>کفش روزمره مردانه نقش بسیار مهمی در استایل و راحتی زندگی روزمره آقایان دارند. این نوع کفش‌ها نه تنها باید ظاهری جذاب داشته باشند بلکه همچنین باید از نظر راحتی و کیفیت همواره تا پایان روز برای آقایان مناسب باشند.</h4><h3><strong>کفش روزمره مردانه: ترکیبی از استایل و راحتی</strong></h3><h4>کفش‌های روزمره مردانه بیشتر از هر چیزی نمایانگر استایل و شخصیت فرد هستند. این کفش‌ها باید با استایل فرد هماهنگ باشند و همزمان راحتی لازم برای فعالیت‌های روزمره را فراهم کنند. در ادامه به برخی از ویژگی‌ها و مزایای کفش‌های روزمره مردانه پرداخته‌ایم.</h4><h5><strong>راحتی بی‌نظیر:</strong></h5><h6>کفش‌های روزمره مردانه معمولاً با فناوری‌های راحتی مجهز شده‌اند که از آقایان در طول روز بی‌نظیر و راحت بمانند.</h6><h5><strong>تنوع طراحی:</strong></h5><h6>این کفش‌ها در طیف گسترده‌ای از طراحی‌ها، از کلاسیک تا مدرن و اسپرت تولید می‌شوند. بنابراین، هر کسی بتواند به راحتی استایل مورد نظر خود را انتخاب کند.</h6><h5><strong>مواد با کیفیت:</strong></h5><h6>ما از مواد با کیفیت برای ساخت این کفش‌ها استفاده می‌کنیم تا برای مصرف‌کننده بهانه‌ای برای ماندگاری و کیفیت داشته باشند.</h6><h5><strong>سبکی و آسانی در پوشیدن:</strong></h5><h6>کفش‌های روزمره مردانه باید سبک و آسان در پوشیدن باشند تا آقایان بتوانند به راحتی و سرزندگی از آن‌ها استفاده کنند.</h6>', 3, 2, 1, 0.00, '2022-11-27 07:35:46', '2023-09-06 08:46:18'),
(5, 'کفش ورزشی مردانه', 'Men\'s sport shoes', 'mens-sport-shoes', NULL, 'کفش ورزشی مردانه با کیفیت و تنوع عالی - خرید آنلاین از فروشگاه کفش اف دی استایل', 'کفش ورزشی مردانه با کیفیت عالی و تنوع بی‌نظیر در فروشگاه اف دی استایل. انتخاب ایده‌آل برای آقایان با سلیقه. با ما همیشه در مد روز باشید. خرید آنلاین با تخفیفات ویژه...', '<h4>کفش ورزشی مردانه نقش بسیار مهمی در عملکرد و تجربه ورزشی آقایان دارند. این کفش‌ها نه تنها باید به اندازه کافی راحتی فراهم کنند بلکه همچنین باید به توانایی انجام ورزش‌های مختلف پاسخ دهند.</h4><h3><strong>کفش ورزشی مردانه: پایه‌ای برای عملکرد ورزشی بهتر</strong></h3><h4>کفش‌های ورزشی مردانه نقش پایه‌ای در بهبود عملکرد ورزشی و کاهش خطرات مرتبط با ورزش ایفا می‌کنند. این کفش‌ها باید دارای ویژگی‌های زیر باشند:</h4><h5><strong>پایداری و حمایت:</strong></h5><h6>کفش‌های ورزشی مردانه باید پایداری و حمایت لازم را برای پا و مچ فراهم کنند تا از آسیب‌های ورزشی جلوگیری کنند.</h6><h5><strong>راحتی و آسانی در حرکت:</strong></h5><h6>این کفش‌ها باید بسیار راحت و خفیف باشند تا ورزشکاران به راحتی در طول ورزش حرکت کنند.</h6><h5><strong>تهویه مناسب:</strong></h5><h6>تهویه مناسب در کفش‌های ورزشی مردانه برای جلوگیری از تعریق و بوی ناپسند پا بسیار اهمیت دارد.</h6><h5><strong>مواد با کیفیت:</strong></h5><h6>مواد با کیفیت در تولید کفش ورزشی مردانه بسیار مهم است تا کفش دوام بیشتری داشته باشد.</h6>', 3, 2, 1, 0.00, '2022-11-27 07:39:11', '2023-09-06 08:46:44'),
(6, 'بوت مردانه', 'men\'s boots', 'mens-boots', NULL, 'بوت مردانه با کیفیت و تنوع عالی - خرید آنلاین از فروشگاه اف دی استایل', 'بوت مردانه با کیفیت عالی و تنوع بی‌نظیر در فروشگاه اف دی استایل. انتخاب ایده‌آل برای آقایان با سلیقه. با ما همیشه در مد روز باشید. خرید آنلاین با تخفیفات ویژه...', '<h4>بوت‌های مردانه نقش اساسی در استایل و کمال‌آراستگی آقایان دارند. این کفش‌ها نه تنها باید شیک و جذاب باشند بلکه همچنین باید از نظر کیفیت و راحتی هم تمامی نیازهای فرد را برآورده کنند.</h4><h3><strong>بوت مردانه: شیکی و راحتی ترکیبی ایده‌آل</strong></h3><h4>بوت‌های مردانه یک ترکیب ایده‌آل از استایل و راحتی برای آقایان فراهم می‌کنند. این کفش‌ها باید دارای ویژگی‌های زیر باشند</h4><h5><strong>جذابیت و شیکی:</strong></h5><h6>بوت‌های مردانه باید با طراحی خاص و جذابیتی ویژه از نظر استایلی برخوردار باشند.</h6><h5><strong>راحتی در پوشیدن:</strong></h5><h6>این کفش‌ها باید راحتی و آسانی در پوشیدن داشته باشند تا آقایان بتوانند آن‌ها را به راحتی استفاده کنند.</h6><h5><strong>مواد با کیفیت:</strong></h5><h6>مواد با کیفیت در ساخت بوت‌های مردانه بسیار اهمیت دارد تا کفش‌ها دوام بیشتری داشته باشند.</h6><h5><strong>پایداری و مقاومت:</strong></h5><h6>بوت‌های مردانه باید پایداری و مقاومت لازم را برای مواجهه با شرایط مختلف فراهم کنند.</h6>', 3, 2, 1, 0.00, '2022-11-27 07:40:29', '2023-09-06 08:47:00'),
(7, 'نیم بوت مردانه', 'Men\'s ankle boots', 'Mens-ankle-boots', NULL, 'نیم بوت مردانه با کیفیت و تنوع عالی - خرید آنلاین از فروشگاه اف دی استایل', 'نیم بوت مردانه با کیفیت عالی و تنوع بی‌نظیر در فروشگاه اف دی استایل. انتخاب ایده‌آل برای آقایان با سلیقه. با ما همیشه در مد روز باشید. خرید آنلاین با تخفیفات ویژه...', '<h4>نیم بوت‌های مردانه یک انتخاب ایده‌آل برای ترکیب استایل و راحتی در آقایان هستند. این کفش‌ها نه تنها باید شیک و جذاب باشند بلکه همچنین باید از نظر کیفیت و راحتی هم تمامی نیازهای فرد را برآورده کنند.</h4><h3><strong>نیم بوت مردانه: انطباق عالی با استایل و فصول</strong></h3><h4>نیم بوت‌های مردانه انعطاف پذیری و تنوع زیادی در استفاده دارند. این کفش‌ها باید دارای ویژگی‌های زیر باشند.</h4><h5><strong>شیک و جذابیت:</strong></h5><h6>نیم بوت‌های مردانه باید با طراحی منحصر به فرد و جذابیتی خاص از نظر استایلی برخوردار باشند.</h6><h5><strong>راحتی در پوشیدن:</strong></h5><h6>این کفش‌ها باید راحتی و آسانی در پوشیدن داشته باشند تا آقایان بتوانند آن‌ها را به راحتی استفاده کنند.</h6><h5><strong>مقاومت و دوام:</strong></h5><h6>نیم بوت‌های مردانه باید مقاومت لازم را برای مواجهه با شرایط مختلف و فصول مختلف داشته باشند.</h6><h5><strong>مواد با کیفیت:</strong></h5><h6>مواد با کیفیت در ساخت نیم بوت‌های مردانه بسیار اهمیت دارد تا کفش‌ها دوام بیشتری داشته باشند.</h6>', 3, 2, 1, 0.00, '2022-11-27 07:41:29', '2023-09-06 08:47:17'),
