INSERT INTO `pages` (`id`, `title`, `slug`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 'شرایط بازگشت کالا', 'return-policy', '<h4 style=\"line-height: 2;\"><span style=\"font-size: 12pt;\"><strong>شرایط بازگشت یا تعویض سفارشات</strong></span></h4>\r\n<p style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>جهت رفاه حال شما مشتریان عزیز، اف&zwnj;دی&zwnj;استایل امکان بازگشت یا تعویض 7 روزه کالا را در اختیار شما قرار داده است بدین معنی که پس از تحویل کالا طبق شرایط زیر امکان تعویض یا عودت کالا را خواهید داشت. برای این منظور لازم است به موارد زیر دقت نمایید:</strong></span></p>\r\n<p style=\"line-height: 2;\">&nbsp;</p>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\"><strong>1-تعویض یا بازگشت&nbsp;کالا</strong></span></div>\r\n<div style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\">اگر شما بعد از تحویل سفارش درخواست تعویض یا بازگشت کالا را داشته باشید می توانید با همکاران پشتیبانی <strong>اف&zwnj;دی&zwnj;استایل</strong> تماس بگیرید و درخواست بازگشت یا تعویض کالا را اطلاع دهید. سپس کالایی را که درخواست بازگشت یا تعویض آن را دارید توسط پست برای اف&zwnj;دی&zwnj;استایل به آدرس \"مازندران، ساری، خیابان فرهنگ، روبه روی فرهنگ ۵، فروشگاه اف&zwnj;دی&zwnj;استایل\" با کد پستی ... ارسال نمایید. پس از دریافت مرسوله توسط اف&zwnj;دی&zwnj;استایل به یکی از دو حالت زیر عمل خواهد شد:</span></div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">اگر شما درخواست تعویض کالا را داشته باشید کالای جدید برای شما پست می&zwnj;شود.</span></div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">اگر شما درخواست عودت کالا را داشته باشید هزینه کالای عودت داده شده به شما برگشت داده خواهد شد.</span></div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">&nbsp;شایان ذکر است تمام هزینه های مربوط به تعویض و یا عودت کالا بر عهده مشتری است.</span></div>\r\n<div style=\"line-height: 2;\">&nbsp;</div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\"><strong>چه نکاتی را برای استفاده از امکان تعویض یا بازگشت کالا باید رعایت کنم؟</strong></span></div>\r\n<div style=\"line-height: 2;\">\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-size: 12pt;\">الف)&nbsp;زمان استفاده از این سرویس تا 7 روز بعد از تحویل کالا&nbsp;می باشد پس اگر شما بعد از تحویل سفارش خود به هر دلیلی تصمیم بر تعویض یا عودت آن را دارید حتماً قبل از اتمام 7 روز اقدام نمایید.</span></div>\r\n<div><span style=\"font-size: 12pt;\">ب)&nbsp;در مدت زمان 7 روز&nbsp;نباید از کالا استفاده شود.</span></div>\r\n</div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">ج) کالای برگشتی می&zwnj;بایست از نظر ظاهری در شرایط اولیه خود توسط اف&zwnj;دی&zwnj;استایل دریافت شود، و هر گونه تغییر فرم ظاهری محصول باعث خروج کالا از شرایط تعویض می&zwnj;شود.</span></div>\r\n<div style=\"line-height: 2;\">&nbsp;</div>\r\n<div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\"><strong>2-&nbsp;وجود ایراد در&nbsp;کالا</strong></span></div>\r\n<div style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\">واحد کنترل کیفیت اف&zwnj;دی&zwnj;استایل قبل از بسته بندی مرسولات، با دقت و حساسیت بالایی کالاهای سفارش داده شده را بررسی نموده و درصورت اطمینان از صحت و تطابق کالا نسبت به ارسال آن اقدام می&zwnj;نماید با این وجود در صورتی که کالای خریداری شده دارای ایراد باشد، و ایراد ذکر شده مورد تأیید کارشناسان اف&zwnj;دی&zwnj;استایل باشد این مجموعه نسبت به تعویض کالا یا استرداد وجه اقدام می&zwnj;نماید. چنانچه موجودی آن کالا در فروشگاه به اتمام رسیده باشد ، مشتریان می&zwnj;توانند درخواست کالای مشابه نموده یا وجه پرداختی را دریافت نمایند.</span></div>\r\n<div style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\">لازم به ذکر است که مراحل فوق ظرف مدت 2 تا 3 روز کاری پس از دریافت کالا توسط اف&zwnj;دی&zwnj;استایل انجام خواهد شد. همچنین هزینه بازگشت کالا تا سقف مبلغ 20 هزار تومان برعهده اف&zwnj;دی&zwnj;استایل خواهد بود.</span></div>\r\n<div style=\"line-height: 2;\">&nbsp;</div>\r\n<div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\"><strong>شرایط تعویض&nbsp;کالا&nbsp;دارای ایراد</strong></span></div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">الف) کاربران می&zwnj;بایست حداکثر ظرف مدت 7 روز بعد از دریافت کالا ایراد را از طریق تماس تلفنی به کارشناسان اف&zwnj;دی&zwnj;استایل اعلام نمایند. بدیهی است پس از گذشت 7 روز کالای مورد نظر شامل این سرویس نمی&zwnj;باشد.</span></div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">ب) ایراد ناشی از استفاده ناصحیح از کالا،&nbsp;برخورد شی تیز و یا سایر مشکلات عمدی نباشد.</span></div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">ج) ایراد اعلام شده توسط کاربر مورد تایید کارشناسان اف&zwnj;دی&zwnj;استایل قرارگیرد.</span></div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">د) کالای برگشتی می&zwnj;بایست از نظر ظاهری در شرایط اولیه خود توسط اف&zwnj;دی&zwnj;استایل دریافت شود، و هر گونه تغییر فرم ظاهری محصول باعث خروج کالا از شرایط تعویض می&zwnj;شود.</span></div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\">در صورتی که پس از استرداد کالا ایراد اعلام شده مورد تایید کارشناسان اف&zwnj;دی&zwnj;استایل نباشد هزینه ارسال مجدد کالا بر عهده مشتری خواهد بود.</span></div>\r\n<div style=\"line-height: 2;\">&nbsp;</div>\r\n<div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\"><strong>3- عدم تطابق کالا</strong></span></div>\r\n<div style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\">در صورتی که کالای تحویلی مغایر با کالای سفارش داده شده توسط مشتری باشد با رعایت شرایط زیر مشمول سرویس تعویض 7 روزه است. در صورتی که کالای مورد نظر در فروشگاه موجود نباشد به انتخاب مشتری، با کالای مشابه دیگر تعویض و یا وجه پرداختی به حساب مشتری واریز می&zwnj;گردد.</span></div>\r\n<div style=\"line-height: 2;\">&nbsp;</div>\r\n<div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\"><strong>شرایط تعویض&nbsp;کالای نامنطبق</strong></span></div>\r\n<div style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\">الف) در صورت عدم انطباق کالای تحویل شده با نمونه ارائه شده در سایت مشتری باید حداکثر تا هفت روز پس از تحویل کالا نسبت به اعلام درخواست تعویض یا عودت کالا به کارشناسان اف دی استایل از طریق تماس تلفنی در قسمت <strong>تماس با ما</strong>&nbsp;اقدام نماید در غیر این صورت کالای مورد نظر شامل این سرویس نمی&zwnj;باشد.</span></div>\r\n<div style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\">ب) استرداد کالا مستلزم جدا نشدن تگ&zwnj;ها از کالا بوده و در صورت جدا شدن و یا مخدوش شدن تگ&zwnj;ها ، کالای خریداری شده قابل استرداد نیست.</span></div>\r\n<div style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\">ج) کالای برگشتی می&zwnj;بایست از نظر ظاهری در شرایط اولیه خود توسط اف دی استایل دریافت شود، و هر گونه تغییر فرم ظاهری محصول باعث خروج کالا از شرایط تعویض می&zwnj;شود.</span></div>\r\n<div style=\"line-height: 2; text-align: justify;\"><span style=\"font-size: 12pt;\">&nbsp;درصورت درخواست تعویض، کالا برای شما تعویض خواهد شد و درصورت درخواست عودت ، وجه کالا به صورت کامل به شما برگشت داده خواهد شد.</span></div>\r\n<div>\r\n<div style=\"line-height: 2;\"><span style=\"font-size: 12pt;\"><strong>\"شایان ذکر است مسئولیت ثبت سفارش با مشتریان محترم می&zwnj;باشد و در صورت تغییر در سفارشات، هزینه ارسال مجدد و برگشت کالا بر عهده مشتریان محترم خواهد بود\"</strong></span></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'published', '2023-03-12 10:44:52', '2023-03-19 08:28:23'),
(2, 'اف دی استایل', 'about-us', '<h2>درباره اف&zwnj;دی استایل</h2>\r\n<p><a href=\"../../\" target=\"_blank\" rel=\"noopener noreferrer\">فروشگاه کفش <strong>اف&zwnj;دی استایل</strong></a> با هدف ایجاد بستری مناسب و امن جهت راحتی هرچه بیشتر مشتریان، برای خرید اینترنتی <strong>کفش ورزشی</strong> و <strong>کفش روزمره</strong> فعالیت خود را آغاز نمود.</p>\r\n<p>محصولات فروشگاه <strong>اف&zwnj;دی استایل</strong> شامل انواع <strong>کفش</strong> و <strong>کتونی</strong> نظیر: انوع <a href=\"../../category/mens-casual-shoes\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>کفش روزمره </strong>و<strong> راحتی مردانه</strong></a>، <a href=\"../../category/mens-sport-shoes\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>کفش ورزشی مردانه</strong></a>، <strong>کفش مناسب پیاده&zwnj;روی</strong>،<strong> </strong><a href=\"../../category/women-sport-shoes\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>کفش ورزشی زنانه</strong></a> می&zwnj;باشد. همچنین ما به دنبال ایجاد تجربه&zwnj;ای شیرین و جدید از خرید اینترنتی برای شما مشتریان گرانقدر می&zwnj;باشیم.</p>', 'published', '2023-03-19 08:12:51', '2023-03-19 08:12:51'),
(3, 'فروشگاه حضوری - ارتباط با ما', 'contact-us', '<p>نحوه ارتباط با فروشگاه اف دی استایل</p>\r\n<p>شما مشتریان عزیز می توانید در شهر ساری علاوه بر خرید اینترنتی به صورت حضوری نیز محصولات خود را از فروشگاه اف دی استایل خریداری نمایید.</p>\r\n<p>آدرس:</p>\r\n<p><span style=\"font-size: 14pt;\"><strong>ساری خیابان فرهنگ روبه&zwnj;روی فرهنگ 5 فروشگاه کتونی اف دی استایل (<span style=\"font-size: 12pt;\"><a href=\"https://www.google.com/maps/place/%D8%A7%D9%81+%D8%AF%DB%8C+%D8%A7%D8%B3%D8%AA%D8%A7%DB%8C%D9%84+%D9%86%D9%85%D8%A7%DB%8C%D9%86%D8%AF%DA%AF%DB%8C+%D9%86%D8%A7%DB%8C%DA%A9+%7C+%D8%A2%D8%AF%DB%8C%D8%AF%D8%A7%D8%B3+%7C+%D9%BE%D9%88%D9%85%D8%A7%E2%80%AD/@36.5601957,53.063172,15z/data=!4m6!3m5!1s0x3f853f743b02e767:0xe92286021718d118!8m2!3d36.5601957!4d53.063172!16s%2Fg%2F11tg4zrgmy\">مسیریابی در گوگل</a></span>)</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">ساعات کاری فروشگاه های حضوری:</span></p>\r\n<p><strong><span style=\"font-size: 14pt;\">هر روز هفته (شنبه تا پنج شنبه) از ساعت 11 الی 22</span></strong></p>\r\n<p><span style=\"font-size: 14pt;\"><span style=\"font-size: 12pt;\">پشتیبانی و امور مشتریان:</span></span><strong><span style=\"font-size: 14pt;\"> 09199127167</span></strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size: 14pt;\"><img src=\"https://fdstorage.fdstyle.ir/about/shop_1.jpg\" alt=\"فروشگاه حضوری اف دی استایل\" width=\"400\" height=\"569\"></span></strong></p>', 'published', '2023-03-19 08:16:21', '2023-03-19 08:34:02'),
(4, 'کتونی‌ مستر کوالیتی چیست؟', 'master-quality-shoes', '<p><strong><span style=\"font-size: 14pt;\">کیفیت کتونی مستر کوالیتی یا کلاس &zwnj;A چیست؟</span></strong></p>\r\n<p style=\"text-align: justify;\">کتونی مستر کوالیتی یک کپی با کیفیت از کتونی اورجینال و در واقع <strong>بهترین کیفیت بعد از کتونی اورجینال</strong> است. جنس رویه&nbsp;<strong>کتونی کلاس A</strong> با <strong>کتونی اورجینال</strong> هیچ فرقی ندارد. و کاملا مشابه می&zwnj;باشد.&nbsp; در کتونی&zwnj;های مستر کوالیتی شما اصلا متوجه تفاوت آن با کتونی اورجینال نخواهید شد یعنی دقیقا همان حس راحتی، شیک بودن در پاهاتون احساس خواهید کرد. ضمن اینکه تولید این کتونی&zwnj;ها کاملا استاندارد میباشد</p>\r\n<p><strong><span style=\"font-size: 14pt;\">کیفیت کتونی اورجینال چیست؟</span></strong></p>\r\n<p style=\"text-align: justify;\">تنها تفاوت کتونی اورجینال با کتونی مستر در <strong>زیره میانی</strong> آن می&zwnj;باشد. در کتونی اورجینال از کربن بیشتری استفاده می&zwnj;شود که باعث شده انعطاف پذیری بیشتر و رفلکس بالاتری داشته باشد.</p>\r\n<p><strong><span style=\"font-size: 14pt;\">کتونی مستر کوالیتی و اورجینال مناسب چه افرادی است؟</span></strong></p>\r\n<p style=\"text-align: justify;\">کتونی&zwnj; اورجینال مناسب ورزشکاران حرفه&zwnj;ای می&zwnj;باشد که به دلیل وجود کربن بیشتر در زیره میانی در هنگام رکورد گیری ورزشی تاثیر بالایی خواهد داشت.&nbsp;</p>\r\n<p style=\"text-align: justify;\">بیش از 85 درصد از مردم دنیا برای استفاده روزمره و غیرحرفه ای، حتی ورزشکاران حرفه&zwnj;ای در تمرینات خود از کتونی کلاس A استفاده می&zwnj;کنند.</p>\r\n<p><strong><span style=\"font-size: 14pt;\">کتونی&zwnj;های مستر کوالیتی کجا تولید می&zwnj;شود؟</span></strong></p>\r\n<p>معمولا کتونی&zwnj;های مستر کلاس A در همان کارخانه کتونی&zwnj;های اورجینال تولید می&zwnj;شوند.</p>', 'published', '2023-03-19 10:03:57', '2023-03-19 15:48:47');
