INSERT INTO `products` (`id`, `name`, `slug`, `barcode`, `image`, `row`, `floor`, `guarantee_id`, `category_id`, `brand_id`, `unit_id`, `offer_id`, `description`, `created_at`, `updated_at`) VALUES
(1002, 'کتونی زنانه ورزشی نایک زوم صورتی مدل 811599009', 'کتونی-زنانه-ورزشی-نایک-زوم-صورتی-مدل-811599009', '1163005', 'uj4Ky185nC_511.jpg,ZHTDUgSl4u_513.jpg,giXp4auHN9_514.jpg,LxJspxRWvJ_515.jpg,HN4paRXlW8_512.jpg', NULL, NULL, 1, 13, 5, NULL, NULL, '<p>برند نایک این مدل را با شعار \"where it all begins\" یعنی جایی که همچی شروع میشود، روانه بازار کرد که به شدت در ایران محبوب شده است که در مدت کوتاهی در رنگ بندی های مختلف در محیط های ورزشی ایران ببینیم. این شعار کنار بند کفش بالای لوگوی نایکی نوشته شده است . همچنین در کنار این شعار تبلیغاتی در رویه این کتونی اعداد \" 45.507n 122.827w\" نوشته شده است که لوکیشن برند نایک در گوگل مپ میباشد .</p><p>این کتونی دارای رویه تنفس پذیر میباشد که منافذ رویه آن بسیار کوچیک میباشد که باعث میشود تناسب خوب بسیار عالی داشته باشد .</p>', '2022-11-27 09:25:19', '2023-04-20 12:08:03'),
(1003, 'کتونی ورزشی زنانه نایک ایرمکس مدل 881981', 'کتونی-ورزشی-زنانه-نایک-ایرمکس-مدل-881981', '3158929', NULL, NULL, NULL, 1, 13, 5, NULL, NULL, '<p><br></p>', '2022-11-27 09:29:04', '2023-04-20 12:08:03'),
(1004, 'کتونی ورزشی زنانه آدیداس آلفا ماگما مشکی مدل 125632938', 'کتونی-ورزشی-زنانه-آدیداس-آلفا-ماگما-مشکی-مدل-125632938', '9023564', 'reztWLwhe7_571.jpg,n9wnyrz9cY_573.jpg,D52EqttoSN_574.jpg,IWLzyGTRor_575.jpg,moGF3jVSjS_572.jpg', NULL, NULL, 1, 13, 2, NULL, NULL, '<p><br></p>', '2022-11-27 09:31:11', '2023-04-20 12:08:03'),
(1005, 'کتونی ورزشی زنانه بروکس ghost مدل 1103711', 'کتونی-ورزشی-زنانه-بروکس-ghost-مدل-1103711', '5990229', 'DSyut8gkW5_561.jpg,evA2nQXAty_563.jpg,I4a8CPuQ6R_564.jpg,DouKJOlBqr_565.jpg,LSvfwbtWW5_562.jpg', NULL, NULL, 1, 5, 13, NULL, NULL, '<p><br></p>', '2022-11-27 09:33:06', '2023-04-20 12:08:03'),
(1006, 'کتونی ورزشی زنانه نایک ایر زوم صورتی مدل 8115990-010', 'کتونی-ورزشی-زنانه-نایک-ایر-زوم-صورتی-مدل-8115990-010', '3748963', 'S0HOgF5vM8_501.jpg,4lpiSwZKa5_503.jpg,rMAKoAGeNu_504.jpg,Hke8Ko3hCn_505.jpg,0uZMc5lTZS_502.jpg', NULL, NULL, 1, 13, 5, NULL, NULL, '<p><br></p>', '2022-11-27 09:36:27', '2023-04-20 12:08:03'),
(1007, 'کتونی ورزشی زنانه نایک ایر زوم نارنجی مدل 7358009', 'کتونی-ورزشی-زنانه-نایک-ایر-زوم-نارنجی-مدل-7358009', '9486721', 'm8HsyFmvwT_631.jpg,5DC0iWrsru_633.jpg,15fmoYqmGD_634.jpg,Wi2PHeuUjj_635.jpg,poyoOnL3AE_632.jpg', NULL, NULL, 1, 12, 5, NULL, NULL, '<h2 class=\"ql-align-justify\"><strong>نایک ایر زوم پگاسوس 39 – Nike Air Zoom Pegasus 39</strong></h2><p class=\"ql-align-justify\">رویه سبک تر از نسخه قبلی خود یعنی <strong>نایک ایر زوم پگاسوس 38</strong> دارد که امکان این را به شما می دهد در هر فصلی از آن استفاده کنید و حس راحتی و انعطاف پذیری خاص و جالب تری نسبت به نسخه های قبلی خودش دارد.</p><p class=\"ql-align-justify\"><strong>کفش نایک ایر زوم پگاسوس 39</strong> با طراحی و توانایی های فوق العاده ای که دارد می تواند به شما کمک کند تا هدف های بزرگ خود را در ورزش خیلی راحت تر دنبال کنید .</p><p class=\"ql-align-justify\">یکی از بزرگ ترین تغییراتی که نسبت به نسخه قبلی خود دارد این است که نایک در قسمت ایر زوم این کفش به جای یک محفظه هوا از دو محفظه مجزا و تقویت شده استفاده کرده است که سرعت انتقال انرژی و ضربه گیری را تا حد خیلی زیادی افزایش میدهد.</p><p class=\"ql-align-justify\">باتوجه این که نایک در این<strong> کفش از سیستم و تکنولوژی فلایور (Flywire)</strong> استفاده کرده است باعث می شود کتونی در هر حالتی کاملا اندازه و فیت پا باشد و همچنین با توجه به بزرگ ترین ویژگی این سیستم ، بند کفش پای شما در هر قدمی که برمی دارید در حال حمایتکردن از پای شما است که نگذارد به راحتی پای شما پیچ بخورد یا از کفش بیرون بیاید.</p><ul><li>استفاده همزمان دو تکنولوژی ایر زوم و ری‌اکت در زیره میانی</li></ul><p class=\"ql-align-justify\">استفاده از <strong>فوم بی نظیر ری‌اکت</strong> با دو محفظه و محفظه هوای ایر زوم که جذب ضربه بی نظیری دارند باعث شده راحتی غیر قابل وصفی را در این کفش حس کنید.</p><p class=\"ql-align-justify\"><strong>فوم ری‌اکت نایک</strong> سبک ترین، با دوام ترین و راحت ترین فوم نایک است که به گفته کمپانی و طراحان نایک، فوم ری‌اکت بهترین فومی است که تا کنون تولید شده است.</p><ul><li class=\"ql-align-justify\">جذب ضربه بالاتر</li></ul><p class=\"ql-align-justify\">در این <strong>کفش کتونی</strong> قسمت پاشنه کفش از فوم بزرگ تری تشکیل شده تا میزان و قدرت چسبندگی و ایست را بالا ببرد و همین امر باعث شد که میزان جذب و انتقال انرژی افزایش یابد و فشار کم تری را در زمان استفاده احساس نمایید .</p><ul><li>راحتی به تمام عیار</li></ul><p class=\"ql-align-justify\">ابر گذاری بیشتر در قسمت زبانه و دور مچ پا امنیت و راحتی خیلی بیشتری را به نسبت نسخه قبلی خودش ارائه می کند.</p><p class=\"ql-align-justify\">نایک از یک <strong>رویه مش</strong> خیلی مقاوم تر و انعطاف پذیرتری نسبت به بقیه رویه های مش در این <strong>کتونی</strong> استفاده کرده است که وزن خیلی کم تری هم نسبت به سری های قبلی خودش دارد و سر تا سر رویه امکان تنفس و گردش هوا به بهترین شکل وجود دارد.</p><p class=\"ql-align-justify\">دیگر مزایا :</p><ol><li class=\"ql-align-justify\">زیره خارجی از لاسیتک محکم و فشرده تولید شده تا اصطحکاک بیشتری با زمین داشته باشد</li><li class=\"ql-align-justify\">زیره خارجی از عاج های خیلی محکم، مقاوم و برجسته ای برخوردار است تا نگذراد پای شما در حین حرکت به راحتی بر روی زمین سر بخورد یا به راحتی تعادلتان را از دست بدهید.</li><li class=\"ql-align-justify\"> زبانه این کفش از رویه جداست و همین موضوع باعث می شود پای شما درون کفش فضای خیلی بهتری داشته باشد.</li></ol><p><br></p>', '2022-11-27 09:38:45', '2023-09-22 09:54:14'),
