(1015, 'کتونی روزمره آدیداس سوپراستار مشکی مدل 118947658', 'کتونی-روزمره-آدیداس-سوپراستار-مشکی-مدل-118947658', '6183155', 'mHWpcgHeJP_461.jpg,3EpKIdrwKM_463.jpg,NWA6x9eUR3_464.jpg,Q7a0dytT5h_465.jpg,niZUVBDNpU_462.jpg', NULL, NULL, 1, 4, 2, NULL, NULL, '<p class=\"ql-align-justify\">شاید باور کردنش مشکل باشد اما سوپر استار در سال 1969 به عنوان یک کتونی بسکتبال تولید و عرضه شد.در واقع طرح کوتاه سوپر استار در کنار مدل نیم ساق آن برای سلایق بازیکنان مختلف به بازار عرضه شد اما رفته رفته این طرح بدون ساق بود که به محبوبیت افسانه ای دست پیدا کرد.</p><p class=\"ql-align-justify\">اوایل عرضه با انواع القاب از جمله shelltoe که اسم مستعار مدل بود یا \"کفش توپی \" یا \"نوک صدفی\" در بین طرفداران و خریداران و مردم جا افتاده بود اما رفته رفته این کفش به عنوان نمادی از ظهور فرهنگ مدرن در نظر گرفته شد.عرضه مدل چرمی نیم ساق با استقبال بی سابقه بسکتبالیست ها مخصوصا کریم عبدالجبار مواجه شد.تکنولوژی و طراحی فوق العاده آن باعث شد بسیاری از محصولات از آن الهام گرفته و تکنولوژیهایش در آن تکرار شوند و محصولات زیادی با این سبک و مواد اولیه چه توسط آدیداس یا برند های دیگر تولید شوند بالاخره سوپراستار به خیابان ها هم راه یافت و این همان زمانیست که این مدل تاثیر ماندگار خود را در این صنعت و فرهنگ مردم به جای گذاشت.</p><p class=\"ql-align-justify\">می توان گفت سوپر استار احیا کننده نام آدیداس در تمام ایالات متحده آمریکا بود.</p><p class=\"ql-align-justify\">در دهه 1980 کفش های ترینر به روی صحنه ها راه یافتند . گروه هیپ هاپ D.M.C آن ها را بدون بند با زبانه باز پوشیده و در پاسخ به آهنگ Felon Sneakers  آهنگ My Adidas را منتشر و به روی صحنه بردند.</p><p class=\"ql-align-justify\">از آن زمان به بعد، این شروع یکی از موفق‌ترین هم‌کاری‌های غیر منتظره موسیقی در مد بود. این اولین باری بود که یک مارک ورزشی برای بازاریابی محصول خود از موسیقی استفاده می‌کرد.<span style=\"background-color: rgb(255, 255, 255); color: rgb(119, 119, 119);\">کفش Superstar تبدیل به بخشی از مد جوانان شده‌است و اکنون به جای ورزش به طور منظم به عنوان یک کتونی همه جا پوش استفاده می‌شود. این محصول هم مانند آل استار شرکت کانورز کار خود را از زمین های بسکتبال شروع کرد و به خیابان ها راه یافت .البته که توانایی طراحان آدیداس در تعامل با جنبش های مد و فرهنگ سازی در میان جوانان انکار ناپذیر است و امروزه سوپر استار به عنوان یک کفش کلاسیک آدیداس جایگاه مهمی در مجموعه ست های مد و لباس دارد.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-center\"> </p><p><br></p>', '2022-11-27 10:00:36', '2023-04-26 12:52:22'),
(1016, 'کتونی روزمره آدیداس سوپراستار صورتی مدل 118947658', 'کتونی-روزمره-آدیداس-سوپراستار-صورتی-مدل-118947658', '7518283', 'oeiuJojRNK_1.jpg,xSo9blNMVy_2.jpg,zb9E06jPxV_3.jpg,eE4RchS2ap_4.jpg,6TMF1bvQWX_5.jpg', NULL, NULL, 1, 4, 2, NULL, NULL, '<p class=\"ql-align-justify\">شاید باور کردنش مشکل باشد اما سوپر استار در سال 1969 به عنوان یک کتونی بسکتبال تولید و عرضه شد.در واقع طرح کوتاه سوپر استار در کنار مدل نیم ساق آن برای سلایق بازیکنان مختلف به بازار عرضه شد اما رفته رفته این طرح بدون ساق بود که به محبوبیت افسانه ای دست پیدا کرد.</p><p class=\"ql-align-justify\">اوایل عرضه با انواع القاب از جمله shelltoe که اسم مستعار مدل بود یا \"کفش توپی \" یا \"نوک صدفی\" در بین طرفداران و خریداران و مردم جا افتاده بود اما رفته رفته این کفش به عنوان نمادی از ظهور فرهنگ مدرن در نظر گرفته شد.عرضه مدل چرمی نیم ساق با استقبال بی سابقه بسکتبالیست ها مخصوصا کریم عبدالجبار مواجه شد.تکنولوژی و طراحی فوق العاده آن باعث شد بسیاری از محصولات از آن الهام گرفته و تکنولوژیهایش در آن تکرار شوند و محصولات زیادی با این سبک و مواد اولیه چه توسط آدیداس یا برند های دیگر تولید شوند بالاخره سوپراستار به خیابان ها هم راه یافت و این همان زمانیست که این مدل تاثیر ماندگار خود را در این صنعت و فرهنگ مردم به جای گذاشت.</p><p class=\"ql-align-justify\">می توان گفت سوپر استار احیا کننده نام آدیداس در تمام ایالات متحده آمریکا بود.</p><p class=\"ql-align-justify\">در دهه 1980 کفش های ترینر به روی صحنه ها راه یافتند . گروه هیپ هاپ D.M.C آن ها را بدون بند با زبانه باز پوشیده و در پاسخ به آهنگ Felon Sneakers  آهنگ My Adidas را منتشر و به روی صحنه بردند.</p><p class=\"ql-align-justify\">از آن زمان به بعد، این شروع یکی از موفق‌ترین هم‌کاری‌های غیر منتظره موسیقی در مد بود. این اولین باری بود که یک مارک ورزشی برای بازاریابی محصول خود از موسیقی استفاده می‌کرد.<span style=\"color: rgb(119, 119, 119); background-color: rgb(255, 255, 255);\">کفش Superstar تبدیل به بخشی از مد جوانان شده‌است و اکنون به جای ورزش به طور منظم به عنوان یک کتونی همه جا پوش استفاده می‌شود. این محصول هم مانند آل استار شرکت کانورز کار خود را از زمین های بسکتبال شروع کرد و به خیابان ها راه یافت .البته که توانایی طراحان آدیداس در تعامل با جنبش های مد و فرهنگ سازی در میان جوانان انکار ناپذیر است و امروزه سوپر استار به عنوان یک کفش کلاسیک آدیداس جایگاه مهمی در مجموعه ست های مد و لباس دارد.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-center\"> </p><p><br></p>', '2022-11-27 10:03:10', '2024-08-21 17:29:49'),
