(1019, 'کفش روزمره نایک زنانه رنگ سفید لوگو سبز مدل کورتز', 'nike-everyday-shoes-white-color-logo-green-cortez', '5432729', '9Xokhezjm3_IMG_6041.jpeg', NULL, NULL, 1, 4, 5, NULL, NULL, '<p class=\"ql-align-justify\"><strong>کفش اسپرت نایک کورتز</strong> که امسال تولید 45 سالگی خودش را جشن میگیرد، کفشی که یکی از بزرگ ترین تحول های صنعت کفش کتونی می باشد و به شکلی می توان عنوان تاثیر گذار ترین کفش برای کفش های اسپرت با استایل حال حاضر نام نمود.</p><p class=\"ql-align-justify\">رویه کفش <strong>نایک کورتز </strong>از جنس چرم بسیار با کیفیت تولید شده است.</p><p class=\"ql-align-justify\">در آن زمان <strong>نایک</strong> برای اولین بار از چرم برای کفش های مخصوص دویدن و پیاده روی استفاده کرد و با استقبال خیلی خوبی هم مواجه شد. یک رویه چرم بسیار با کیفیت که در کنار تنفس پذیری مناسب از مقاومت و دوام بی نظیری هم برخوردار می باشد.</p><p class=\"ql-align-justify\">زیره میانی و خارجی این <strong>کتونی</strong> زیبا و منحصر به فرد یک تیکه می باشد و از جنس لاستیک خیلی خاصی تولید شده و دندانه هایی که به عنوان عاج های این کفش در نظر گرفته شده، باعث می شود در حین استفاده از این کفش فوق العاده چسبندگی خاصی را به زمین تجربه کنید.</p><p class=\"ql-align-justify\"><strong>نایک کورتز</strong> با این که در ابتدا برای دویدن طراحی شد ولی در بین استفاده کننده های عمومی خیلی مورد استقبال قرار گرفت و پس از آن کاربرد این کفش به یک کفش اسپرت خیابانی تغییر کرد که به راحتی بتوان از آن در هر سطح و موقعیتی استفاده کرد و به بهترین شکل لباس خود را با آن ست کنید و از پوشیدن این کفش کتونی نایک لذت ببرید.</p><p><br></p>', '2022-11-27 10:07:49', '2025-02-16 14:08:27'),
(1020, 'کفش روزمره نایک زنانه رنگ مشکی مدل کورتز', 'nike-everyday-shoes-black-color-cortez', '3291321', 'vS1BLqCnDr_IMG_6040.jpeg', NULL, NULL, 1, 12, 5, NULL, NULL, '<p class=\"ql-align-justify\"><strong>کفش اسپرت نایک کورتز</strong> که امسال تولید 45 سالگی خودش را جشن میگیرد، کفشی که یکی از بزرگ ترین تحول های صنعت کفش کتونی می باشد و به شکلی می توان عنوان تاثیر گذار ترین کفش برای کفش های اسپرت با استایل حال حاضر نام نمود.</p><p class=\"ql-align-justify\">رویه کفش <strong>نایک کورتز </strong>از جنس چرم بسیار با کیفیت تولید شده است.</p><p class=\"ql-align-justify\">در آن زمان <strong>نایک</strong> برای اولین بار از چرم برای کفش های مخصوص دویدن و پیاده روی استفاده کرد و با استقبال خیلی خوبی هم مواجه شد. یک رویه چرم بسیار با کیفیت که در کنار تنفس پذیری مناسب از مقاومت و دوام بی نظیری هم برخوردار می باشد.</p><p class=\"ql-align-justify\">زیره میانی و خارجی این <strong>کتونی</strong> زیبا و منحصر به فرد یک تیکه می باشد و از جنس لاستیک خیلی خاصی تولید شده و دندانه هایی که به عنوان عاج های این کفش در نظر گرفته شده، باعث می شود در حین استفاده از این کفش فوق العاده چسبندگی خاصی را به زمین تجربه کنید.</p><p class=\"ql-align-justify\"><strong>نایک کورتز</strong> با این که در ابتدا برای دویدن طراحی شد ولی در بین استفاده کننده های عمومی خیلی مورد استقبال قرار گرفت و پس از آن کاربرد این کفش به یک کفش اسپرت خیابانی تغییر کرد که به راحتی بتوان از آن در هر سطح و موقعیتی استفاده کرد و به بهترین شکل لباس خود را با آن ست کنید و از پوشیدن این کفش کتونی نایک لذت ببرید.</p><p><br></p>', '2022-11-27 10:08:22', '2025-02-16 14:07:52'),
