(1024, 'کتونی ورزشی آدیداس بونس مدل 127829414', 'کتونی-ورزشی-آدیداس-بونس-مدل-127829414', '1701391', '38afaOlyoX_421.jpg,G157KIW3Fm_423.jpg,YUzfjWcgfi_424.jpg,MXlTMTjaas_425.jpg,bngxRtERKp_422.jpg', NULL, NULL, 1, 5, 2, NULL, NULL, '<p><br></p>', '2022-11-27 10:17:21', '2023-04-20 12:08:05'),
(1025, 'کتونی روزمره پوما suede مشکی مدل 35263403', 'کتونی-روزمره-پوما-suede-مشکی-مدل-35263403', '5568609', 'phyEINZIEn_411.jpg,RifKVpKHub_413.jpg,blaMJL5P7z_414.jpg,lkLRJaT0pP_415.jpg,zQlU706bXD_412.jpg', NULL, NULL, 1, 12, 6, NULL, NULL, '<p class=\"ql-align-justify\">یکی از معروف ترین کفش های کلاسیک و استایلی پوما می باشد که طرفدار بسیار زیادی در بین جوانان و نوجوانان دارد.</p><p class=\"ql-align-justify\">زیرا جزء کفش های کتونی می باشد که طراحی بسیار شیک و ساده ای دارد و در کنار این ها از کیفیت خیلی بالایی برخوردار می باشد و همچنین زیره خارجی تقویت شده ای دارد که به شما این امکان را می دهد این کفش فوق را برای استفاده های طولانی مدت هم استفاده کنید.</p><p class=\"ql-align-justify\">رویه کفش اسپرت پوما سوید از چرم مخمل نمایی چند لایه ای تولید شده که از دوام و کیفیت خیلی بالایی برخوردار است.</p><p class=\"ql-align-justify\">پوما برای افزایش دوام این کفش در اطراف و حاشیه های آن از چند لایه تقویت شده خیلی خاص استفاده کرده است که نگذارد کفش شما به راحتی در هنگام فشار های مختلف پاره شود.</p><p class=\"ql-align-justify\">رنگ بندی و طراحی آن به شکلی است که به شما این اجازه را می دهد به راحتی با هر سبک و رنگی لباس خود را با آن ست کنید و یک استایل خاص و متفاوت را تجربه نمایید.</p><p class=\"ql-align-justify\">زیره خارجی این کفش نتیجه یک لاستیک بسیار مقاوم، تقویت شده و ولکانیزه شده تولید شده است که باعث می شود دوام و استقامت آن چندین برابر شود.</p><p class=\"ql-align-justify\">همچنین این زیره خارجی از چسبندگی و انعطاف پذیری خاصی هم برخوردار است که این ویژگی یکی از بزرگ ترین ویژگی های این کفش می باشد.</p><p> </p><p class=\"ql-align-justify\">ویژگی های این کفش:</p><ol><li class=\"ql-align-justify\"> رویه از جنس جیر یا چرم مخمل نما</li><li class=\"ql-align-justify\"> زبانه پد گزاری شده و خیلی نرم</li><li class=\"ql-align-justify\"> زیره لاستیکی ولکانیزه شده</li><li> استفاده از نیتروژن در زیره خارجی برای جذب و انتقال بهتر انرژی</li><li> استفاده از Formstrip پوما در داخل و خارج کفش برای افزایش دوام</li></ol><p><br></p>', '2022-11-27 10:20:47', '2023-04-20 12:08:05'),
