(1129, 'کفش کتونی روزمره آدیداس مردانه طوسی مدل طوسی مدل سوپراستار', 'Adidas-everyday-shoes-grey-superstar', '2644960', 'qhFPui4OS1_351.jpg,ND23JWlzK8_353.jpg,qqSeoOihVK_354.jpg,e9kHGlWTjm_355.jpg,BCsO4d2OUb_352.jpg', NULL, NULL, 1, 4, 2, NULL, NULL, '<p class=\"ql-align-justify\">شاید باور کردنش مشکل باشد اما سوپر استار در سال 1969 به عنوان یک کتونی بسکتبال تولید و عرضه شد.در واقع طرح کوتاه سوپر استار در کنار مدل نیم ساق آن برای سلایق بازیکنان مختلف به بازار عرضه شد اما رفته رفته این طرح بدون ساق بود که به محبوبیت افسانه ای دست پیدا کرد.</p><p class=\"ql-align-justify\">اوایل عرضه با انواع القاب از جمله shelltoe که اسم مستعار مدل بود یا \"کفش توپی \" یا \"نوک صدفی\" در بین طرفداران و خریداران و مردم جا افتاده بود اما رفته رفته این کفش به عنوان نمادی از ظهور فرهنگ مدرن در نظر گرفته شد.عرضه مدل چرمی نیم ساق با استقبال بی سابقه بسکتبالیست ها مخصوصا کریم عبدالجبار مواجه شد.تکنولوژی و طراحی فوق العاده آن باعث شد بسیاری از محصولات از آن الهام گرفته و تکنولوژیهایش در آن تکرار شوند و محصولات زیادی با این سبک و مواد اولیه چه توسط آدیداس یا برند های دیگر تولید شوند بالاخره سوپراستار به خیابان ها هم راه یافت و این همان زمانیست که این مدل تاثیر ماندگار خود را در این صنعت و فرهنگ مردم به جای گذاشت.</p><p class=\"ql-align-justify\">می توان گفت سوپر استار احیا کننده نام آدیداس در تمام ایالات متحده آمریکا بود.</p><p class=\"ql-align-justify\">در دهه 1980 کفش های ترینر به روی صحنه ها راه یافتند . گروه هیپ هاپ D.M.C آن ها را بدون بند با زبانه باز پوشیده و در پاسخ به آهنگ Felon Sneakers  آهنگ My Adidas را منتشر و به روی صحنه بردند.</p><p class=\"ql-align-justify\">از آن زمان به بعد، این شروع یکی از موفق‌ترین هم‌کاری‌های غیر منتظره موسیقی در مد بود. این اولین باری بود که یک مارک ورزشی برای بازاریابی محصول خود از موسیقی استفاده می‌کرد.<span style=\"background-color: rgb(255, 255, 255); color: rgb(119, 119, 119);\">کفش Superstar تبدیل به بخشی از مد جوانان شده‌است و اکنون به جای ورزش به طور منظم به عنوان یک کتونی همه جا پوش استفاده می‌شود. این محصول هم مانند آل استار شرکت کانورز کار خود را از زمین های بسکتبال شروع کرد و به خیابان ها راه یافت .البته که توانایی طراحان آدیداس در تعامل با جنبش های مد و فرهنگ سازی در میان جوانان انکار ناپذیر است و امروزه سوپر استار به عنوان یک کفش کلاسیک آدیداس جایگاه مهمی در مجموعه ست های مد و لباس دارد.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-center\"> </p><p><br></p>', '2023-02-18 14:28:37', '2025-07-15 08:34:22'),
(1130, 'نیم بوت روزمره مردانه نایکی بیلی ایلیش کرم مدل dm7926', 'نیم-بوت-روزمره-مردانه-نایکی-بیلی-ایلیش-کرم-مدل-dm7926', '1698820', 'rMFNakcdwJ_301.jpg,5LJ0Bympd7_303.jpg,6AWDvWNTO4_304.jpg,S944Vnh8eD_305.jpg,60zdszGNea_302.jpg', NULL, NULL, 1, 7, 5, NULL, NULL, '<h2 class=\"ql-align-justify ql-direction-rtl\">کفش لایف استایل نایک بیلی ایلیش</h2><p class=\"ql-align-justify ql-direction-rtl\">مهم‌ترین تمایز نیم بوت روزمره مردانه نایکی بیلی ایلیش با سایر نیم بوت‌ها، استفاده از چرم اشبالت در تولید رویه و زیره میانی آن از جنس RUBBER این محصول است. این کفش راحتی نایک بیلی ایلیش مناسب سطوح جاده آسفالت، سنگ فرش، سالن و پارکت است. نحوه‌ی بسته شدن این کفش به صورت بندی و چسبی است که سبب پوشیدن راحت تر و سریع تر آن می‌شود. این محصول با کیفیت با رنگ کرمی و طراحی کلاسیکی که دارد، انتخابی جذاب برای استفاده‌ی روزمره‌ی آقایان و لایف استایل است. این کتونی طراحی و تولید با کیفیتی بی نظیر از کشور ویتنام است. اگر نیاز به کفشی شیک، ظاهر آراسته و با دوام دارید ما کفش نایک بیلی آیلیش را به شما پیشنهاد می دهیم.</p><p><br></p>', '2023-02-18 14:42:24', '2025-07-16 08:34:23'),
(1131, 'کتونی روزمره نایک رنگ سفید زرد مدل ایرفورس 1', 'Nike-everyday-shoes-white/yellow-air-force-1', '7137344', 'RzaJkGzxFs_291.jpg,B9rdFEs7Y9_293.jpg,QtzUTZ20I7_294.jpg,o19CgQv7FS_295.jpg,HMdmjtjVlf_292.jpg', NULL, NULL, 1, 4, 5, NULL, NULL, '<blockquote>Nike Air Force 1 با جشن گرفتن 40 سال طراحی جاودانه در سال گذشته ب طور همزمان ادای احترام رنگارنگی را به هند غربی و 13 کشور جزیره ای مستقل و 18 منطقه وابسته آن در تابستان برگردانند.</blockquote><blockquote>در حالی که این مدل تحت سلطه آثار سبز پر جنب و جوش بوده نسخه اولیه آن در سال 2003 تنها یکی از چهار تصویری بود که در کنسرت کارناوال رژه روز غرب هند در نیویورک منتشر شد.</blockquote><blockquote>پیش از جشن آتی تیم Swoosh با برداشتن جفت لهجه زرد روشن از آرشیو برای بازگشت دو دهه بعدی ب چهارگانه رنگها باز می گردد.رنگ خربزه ای که به ندرت رنگ < طلای دانشگاه > را روشن میکند:رنگ خربزه ای را با استفاده از آستر جوراب نایلونی ،زبانه پاشنه و آج منعکس میکند.با هماهنگی ساختار چرمی ساده و چرخدار ابزار سالگرد جشن Af1،اکثر قسمت های بالای کتونی در رنگ های سفید خالی فرو می روند.</blockquote>', '2023-02-18 15:39:01', '2024-11-17 15:14:17');
