(1132, 'کتونی روزمره مردانه نایک ایر جردن 1 لو پاریس – Nike Air Jordan 1 Paris', 'کتونی-روزمره-مردانه-نایک-ایر-جردن-1-لو-پاریس-–-Nike-Air-Jordan-1-Paris', '6598342', 'PQ0ahm3Caz_321.jpg,gHR2yhZsrW_323.jpg,yqLCmQJ4lj_324.jpg,sI5bl38I4v_325.jpg,0pbTJvofUT_322.jpg', NULL, NULL, 1, 4, 5, NULL, NULL, '<p class=\"ql-align-justify\"><strong>نایک ایر جردن 1 لو پاریس </strong>یکی جدید ترین طرح هایی می باشد که نایک معرفی کرده و همه مخاطبان و استایلیست ها را شگفت زده کرده است.</p><p class=\"ql-align-justify\">در طراحی و رنگ بندی به کار رفته در این <strong>کفش مردانه</strong> از طراحی معماری و حس و حال شهر پاریس الهام گرفته شده که به نوبه خود ویژگی جذابی به نظر می رسد.</p><p>این <strong>کتانی اسپرت</strong> از سری کفش های ایر جردن 1 با همان استایل و طراحی سنتی این کفش تولید شده و جزئیات و ریزه کاری های به کار رفته در این کفش با ترکیب رنگی که برای آن در نظر گرفته اند جذابیت و زیبایی خاصی برای خودشان ایجاد کرده اند.</p><p>رنگ بندی سفید، خاکستری و فیروزه ای از جنس چرم و نبوک، این کفش را به یک کفش فشن و کلاسیک تبدیل کرده که باعث می شود شما با هر سبک و استایلی که دوست دارید خیلی راحت بتوانید این کفش را با لباس هایتان ست کنید.</p><p>در بخش پشتی پاشنه از یک تکه چرم بسیار محکم به کار رفته است که به لایه های زیرین با نخی فوق العاده با کیفیت دوخته شده است.</p><p class=\"ql-align-justify\">طراحان نایک برای اینکه به استقامت این کفش تا حدی زیادی کمک کنند در بخش جلویی کفش از یک تکه پارچه نبوک فوق العاده با کیفیت استفاده کرده اند که هم از ورود آسیب به کفش جلوگیری میکند و هم به ایستایی کفش کمک میکند.</p><p class=\"ql-align-justify\"><strong>کفش کتانی نایک</strong> ایر جردن 1 لو پاریس مثل تمامی مدل های ایرجردن زیره میانی و خارجی یک دست و یکسره دارد که از جنس یک لاستیک انعطاف پذیر و فوق العاده راحتی تولید شده.</p><p class=\"ql-align-justify\">نایک با بالشتک گذاری و پد گذاری حرفه ای که در سر تا سر زیره میانی برای آن در نظر گرفته اند حس راحتی خوش آیندی را در حین پیاده روی و یا حتی دویدن با این کفش به شما منتقل میکند.</p><p class=\"ql-align-justify\">زیره خارجی <strong>کتونی</strong> نایک ایر جردن 1 لو پاریس از تعداد زیادی عاج و حفره های بزرگ و کوچکی برخوردار می باشد که طراحی آن همچون دیگر نسخه های این سری از کفش های نایک می باشد.</p><p class=\"ql-align-justify\">این عاج ها که از جنس لاستیک (Rubber) بسیار مستحکم و با دوامی تولید شده قدرت چسبندگی و انعطاف پذیری فوق العاده زیادی دارند و به هیچ عنوان نمیگذارند پای شما بر روی سطوح لغزنده به آسانی سر بخورد.</p><p class=\"ql-align-justify\"><br></p><p><br></p>', '2023-02-18 20:53:48', '2023-04-20 12:08:12'),
(1133, 'کتونی روزمره مردانه نایک جردن sb سفید لوگو آبی', 'کتونی-روزمره-مردانه-نایک-جردن-sb-سفید-لوگو-آبی', '3271180', 'GIM1asorKo_251.jpg,N9u6vJo52V_253.jpg,qpu1T5Sb6V_254.jpg,4fEJ2jJgGV_255.jpg,gy2Kn6YFx9_252.jpg', NULL, NULL, 1, 4, 5, NULL, NULL, '<p><br></p>', '2023-02-18 20:58:49', '2023-04-20 12:08:12'),
(1134, 'کتونی ورزشی مردانه نایک ایرزوم پگاسوس 39 سرمه ای', 'کتونی-ورزشی-مردانه-نایک-ایرزوم-پگاسوس-39-سرمه-ای', '6137348', 'SAagRNjwtq_341.jpg,3KlIWFNW9j_343.jpg,CKMD0uHLBl_344.jpg,QDMAo6q9sg_345.jpg,j1u3UkrjYu_342.jpg', NULL, NULL, 1, 5, 5, NULL, NULL, '<h2 class=\"ql-align-justify\"><strong>نایک ایر زوم پگاسوس 39 – Nike Air Zoom Pegasus 39</strong></h2><p class=\"ql-align-justify\">رویه سبک تر از نسخه قبلی خود یعنی <strong>نایک ایر زوم پگاسوس 38</strong> دارد که امکان این را به شما می دهد در هر فصلی از آن استفاده کنید و حس راحتی و انعطاف پذیری خاص و جالب تری نسبت به نسخه های قبلی خودش دارد.</p><p class=\"ql-align-justify\"><strong>کفش نایک ایر زوم پگاسوس 39</strong> با طراحی و توانایی های فوق العاده ای که دارد می تواند به شما کمک کند تا هدف های بزرگ خود را در ورزش خیلی راحت تر دنبال کنید .</p><p class=\"ql-align-justify\">یکی از بزرگ ترین تغییراتی که نسبت به نسخه قبلی خود دارد این است که نایک در قسمت ایر زوم این کفش به جای یک محفظه هوا از دو محفظه مجزا و تقویت شده استفاده کرده است که سرعت انتقال انرژی و ضربه گیری را تا حد خیلی زیادی افزایش میدهد.</p><p class=\"ql-align-justify\">باتوجه این که نایک در این<strong> کفش از سیستم و تکنولوژی فلایور (Flywire)</strong> استفاده کرده است باعث می شود کتونی در هر حالتی کاملا اندازه و فیت پا باشد و همچنین با توجه به بزرگ ترین ویژگی این سیستم ، بند کفش پای شما در هر قدمی که برمی دارید در حال حمایتکردن از پای شما است که نگذارد به راحتی پای شما پیچ بخورد یا از کفش بیرون بیاید.</p><ul><li>استفاده همزمان دو تکنولوژی ایر زوم و ری‌اکت در زیره میانی</li></ul><p class=\"ql-align-justify\">استفاده از <strong>فوم بی نظیر ری‌اکت</strong> با دو محفظه و محفظه هوای ایر زوم که جذب ضربه بی نظیری دارند باعث شده راحتی غیر قابل وصفی را در این کفش حس کنید.</p><p class=\"ql-align-justify\"><strong>فوم ری‌اکت نایک</strong> سبک ترین، با دوام ترین و راحت ترین فوم نایک است که به گفته کمپانی و طراحان نایک، فوم ری‌اکت بهترین فومی است که تا کنون تولید شده است.</p><ul><li class=\"ql-align-justify\">جذب ضربه بالاتر</li></ul><p class=\"ql-align-justify\">در این <strong>کفش کتونی</strong> قسمت پاشنه کفش از فوم بزرگ تری تشکیل شده تا میزان و قدرت چسبندگی و ایست را بالا ببرد و همین امر باعث شد که میزان جذب و انتقال انرژی افزایش یابد و فشار کم تری را در زمان استفاده احساس نمایید .</p><ul><li>راحتی به تمام عیار</li></ul><p class=\"ql-align-justify\">ابر گذاری بیشتر در قسمت زبانه و دور مچ پا امنیت و راحتی خیلی بیشتری را به نسبت نسخه قبلی خودش ارائه می کند.</p><p class=\"ql-align-justify\">نایک از یک <strong>رویه مش</strong> خیلی مقاوم تر و انعطاف پذیرتری نسبت به بقیه رویه های مش در این <strong>کتونی</strong> استفاده کرده است که وزن خیلی کم تری هم نسبت به سری های قبلی خودش دارد و سر تا سر رویه امکان تنفس و گردش هوا به بهترین شکل وجود دارد.</p><p class=\"ql-align-justify\">دیگر مزایا :</p><ol><li class=\"ql-align-justify\">زیره خارجی از لاسیتک محکم و فشرده تولید شده تا اصطحکاک بیشتری با زمین داشته باشد</li><li class=\"ql-align-justify\">زیره خارجی از عاج های خیلی محکم، مقاوم و برجسته ای برخوردار است تا نگذراد پای شما در حین حرکت به راحتی بر روی زمین سر بخورد یا به راحتی تعادلتان را از دست بدهید.</li><li class=\"ql-align-justify\"> زبانه این کفش از رویه جداست و همین موضوع باعث می شود پای شما درون کفش فضای خیلی بهتری داشته باشد.</li></ol><p><br></p>', '2023-02-18 21:12:41', '2023-09-09 19:37:24'),
