(1151, 'کفش روزمره مردانه نایک sb dunk low pro qs', 'کفش-روزمره--مردانه-nike-sb-dunk-low-pro-qs', '19314558435816', 'gggfzL3r9D_1.jpg,7gd2InxOkl_2.jpg,X4mRusXcLR_3.jpg,aFWphxjTkX_4.jpg,yEaAnC5R48_5.jpg', NULL, NULL, 1, 4, 5, NULL, NULL, '<blockquote class=\"ql-direction-rtl\"><sup>﻿</sup>با الهام از تیم LOS Angeles Dodgers MLB.این مدل نایکی دارای رنگها و جزییاتی از فرچاینز داستانی است. رویه با پارچه چرمی سفید و روکش های جیر آبی و Swoosh پارچه ای آبی ساخته شده است.</blockquote><blockquote class=\"ql-direction-rtl\">برچسب های زبان درونی دارای گرافیک درخت نخل در کفش چپ و علامت خوش آمدگویی استادیوم Dodger در کفش سمت راست هستند.</blockquote><blockquote class=\"ql-direction-rtl\">یک زیره میانی سفید به یک زیره لاستیکی آدامسی منتهی میشود.با لکه های صورتی کوچک روی کفش سمت راست که ظاهر آدامس حبابی چسبیده روی پاشنه کفش را نشان میدهد.</blockquote><blockquote class=\"ql-direction-rtl\"><br></blockquote>', '2023-04-11 12:26:34', '2023-09-09 18:27:04'),
(1152, 'کفش روزمره مردانه نایک ایر فورس NIKE AIR FORCE 1 COFFE', 'کفش-روزمره-مردانه-نایک-ایر-فورس-NIKE-AIR-FORCE-1-COFFE', '19365788965116', 'NFcMF5PO5q_1.jpg,zlquDyNTTU_2.jpg,eFScuVjfQH_3.jpg,EO4g9To6sB_4.jpg', NULL, NULL, 1, 4, 5, NULL, NULL, '<p class=\"ql-align-right\"><strong style=\"color: black;\">اگر نوشیدن قهوه در صبح را به جای چای ترجیح می‌دهید، نگاهی دقیق‌تر به قهوه آتی Nike Air Force 1 Low Coffee بیندازید! این آخرین پیشنهاد از Air Force 1 نمادین است که توسط تیم Swoosh رونمایی شده است و یکی از تمیزترین نسخه های AF1 سال است. ما می توانیم تضمین کنیم که سطح تبلیغات در این جفت بسیار بالا خواهد بود.</strong></p><p class=\"ql-align-right\"><br></p><p class=\"ql-align-right\"><strong style=\"color: black;\">تصاویر رسمی، سیلوئت پایین را نشان می‌دهند که یک پالت رنگی زیبا را به نمایش می‌گذارد که دارای ترکیبی لذیذ از رنگ‌های کرم، قهوه‌ای و فندقی است که منجر به رنگی می‌شود که مانند یک فنجان قهوه داغ در صبح دلپذیر به نظر می‌رسد.</strong></p><p class=\"ql-align-right\"><br></p><p class=\"ql-align-right\"><strong style=\"color: black;\">در حالی که پنل‌های رویه دارای ترکیبی عالی از مواد جیر انعطاف‌پذیر و پارچه‌های جین مانند هستند، زیره میانی هوا از آدامس لاستیکی لکه‌دار زیر پا قرار می‌گیرد تا ظاهری شبیه به تفاله قهوه به آن بدهد. تکمیل تم قهوه به طور کلی، متنی روی پاشنه جانبی چاپ شده است که روی آن نوشته شده است: «ROASTED BY NIKE, INC, LOT 97005, SP21» و یک نقاشی گرافیکی زیبا از گربه‌ای که از لیوانی که روی کفی‌ها چاپ شده است</strong><strong>.</strong></p><p class=\"ql-align-right\"><br></p><p class=\"ql-align-right\"><br></p><p><br></p>', '2023-04-11 12:34:14', '2023-04-26 11:14:28'),
