(1155, 'کفش ورزشی زنانه میزانو wave inspire 17-Mizuno Wave Inspire 17 Women\'s Running', 'کفش-ورزشی-زنانه-میزانو-wave-inspire-17Mizuno-Wave-Inspire-17-Women\'s-Running', '411310', 'D2BSurmRp3_1.jpg,mHWaPpE2Um_3.jpg,mi7g9fSI7h_4.jpg,gtTIZQQ8US_5.jpg,Vrvy46PLSw_2.jpg', NULL, NULL, 2, 13, 20, NULL, NULL, '<p>مهم نیست که حرکت بعدی شما چیست:کوه پاشنه MIZUNO ENERZY جدید بالشتک بیشتر و موج فن شکل به روز شده که شما را به نرم ترین شکل ممکن میزساند. MIZUNO ENERZY: یک فوم کاملاً جدید که در مقایسه با فناوری‌های قبلی Running EVA - U4ic و U4icX، واکنش‌پذیرتر و ویژگی‌های فنری بیشتری دارد.</p><p>U4ic Midsole: کاهش ضربه بهینه، دوام و سواری عالی را ارائه می دهد. سبک نوآورانه، بالشتک خوب، پاسخگو و انعطاف پذیر</p><p>زیره X10: لاستیک کربنی بادوام که امکان سایش طولانی‌تر را فراهم می‌کند.</p><p>صفحه موج فن</p><p>رویه مش مهندسی شده: هم قابل تنفس و هم بادوام برای عملکرد بالا.</p><p>وزن: 9.2 اونس، افت: 12 میلی متر.</p><p><br></p>', '2023-04-11 20:17:53', '2023-04-27 12:36:39'),
