(1157, 'کفش ورزشی زنانه میزانو wave rider 25', 'کفش-ورزشی-زنانه-میزانو-wave-rider-25', '411324.271r', 'CsW3FetZ14_1.jpg,Mdew51fsFe_2.jpg,MDyxsKnym6_3.jpg,rMQluA9OqA_4.jpg,I8CI6Ev5og_5.jpg', NULL, NULL, 2, 13, 20, NULL, NULL, '<p>مهم نیست که حرکت بعدی شما چیست:کوه پاشنه MIZUNO ENERZY جدید بالشتک بیشتر و موج فن شکل به روز شده که شما را به نرم ترین شکل ممکن میزساند. MIZUNO ENERZY: یک فوم کاملاً جدید که در مقایسه با فناوری‌های قبلی Running EVA - U4ic و U4icX، واکنش‌پذیرتر و ویژگی‌های فنری بیشتری دارد.</p><p>U4ic Midsole: کاهش ضربه بهینه، دوام و سواری عالی را ارائه می دهد. سبک نوآورانه، بالشتک خوب، پاسخگو و انعطاف پذیر</p><p>زیره X10: لاستیک کربنی بادوام که امکان سایش طولانی‌تر را فراهم می‌کند.</p><p>صفحه موج فن</p><p>رویه مش مهندسی شده: هم قابل تنفس و هم بادوام برای عملکرد بالا.</p><p>وزن: 9.2 اونس، افت: 12 میلی متر.</p><p><br></p>', '2023-04-12 11:39:49', '2023-04-27 13:11:28'),
(1158, 'The HOKA ONE ONE Arahi 5، کفش ورزشی زنانه HOKA سرمه ای', 'The-HOKA-ONE-ONE-Arahi-5،-کفش-ورزشی-زنانه-HOKA-سرمه-ای', '1115010', 'tS6hRjgtoI_1.jpg,LPTMbfb2wl_2.jpg,sBrBl4HF49_3.jpg,gOL02Z79qi_4.jpg,5T5nP3QXPm_5.jpg', NULL, NULL, 2, 13, 37, NULL, NULL, '<p class=\"ql-align-right\">·        با هر بار تکرار، آراهی تاریخ را به عنوان یک کلاس متفاوت از کفش پشتیبانی بازنویسی می کند. آراهی 5 با ترکیبی به ظاهر متناقض از حداکثر بالشتک و حداقل وزن، جایگزینی نرم و صاف برای کفش های پشتیبانی سنتی ارائه می کند. یک کفش کاملاً جدید از بالا تا پایین، Arahi 5 با تمرکز لیزر بر روی تناسب در نظر گرفته شد. رویه جدید که با مش ساختاری و مهندسی شده در پاشنه برای امنیت میانی پا و قابلیت تنفس و مش باز در قسمت جلویی پا طراحی شده است، رویه جدید در یک فوم بسیار انعطاف پذیر و فوق سبک به زمین متصل شده است. این دونده روزانه با یک زبانه کششی بصری برای روشن و خاموش کردن آسان، یک شکل یقه ظریف ارائه می دهد که فشار وارده بر آشیل را کاهش می دهد. برای ثبات بدون محدودیت آماده شوید.</p><p><br></p>', '2023-04-12 11:43:06', '2024-11-19 14:26:33'),
