(1167, 'کفش روزمره مردانه نایک nike-atsumu-trail', 'کفش-روزمره-مردانه-نایک-nike-atsumu-trail', 'CQ9178', 'sJ0X1ZJ9Nk_1.jpg,1gG4kULG5y_2.jpg,exD6TaL8xS_3.jpg,E6tj5Ow44F_4.jpg,ZZUc4nVeYY_5.jpg', NULL, NULL, 1, 4, 5, NULL, NULL, '<p><br></p>', '2023-04-12 12:44:34', '2023-04-20 12:08:14'),
(1168, 'کفش کتونی روزمره آدیداس سوپر استار زنانه ی لگو سبز', 'Adidas-everyday-shoes-white-lego-green-superstar', '3957', 'gfEbEgueXx_1.jpg,FViVe2mGMH_2.jpg,85bg3YB4Ee_3.jpg,wPRG4BBHyN_4.jpg,nzKwwJx6r4_5.jpg', NULL, NULL, 1, 12, 2, NULL, NULL, '<p class=\"ql-align-justify\">شاید باور کردنش مشکل باشد اما سوپر استار در سال 1969 به عنوان یک کتونی بسکتبال تولید و عرضه شد.در واقع طرح کوتاه سوپر استار در کنار مدل نیم ساق آن برای سلایق بازیکنان مختلف به بازار عرضه شد اما رفته رفته این طرح بدون ساق بود که به محبوبیت افسانه ای دست پیدا کرد.</p><p class=\"ql-align-justify\">اوایل عرضه با انواع القاب از جمله shelltoe که اسم مستعار مدل بود یا \"کفش توپی \" یا \"نوک صدفی\" در بین طرفداران و خریداران و مردم جا افتاده بود اما رفته رفته این کفش به عنوان نمادی از ظهور فرهنگ مدرن در نظر گرفته شد.عرضه مدل چرمی نیم ساق با استقبال بی سابقه بسکتبالیست ها مخصوصا کریم عبدالجبار مواجه شد.تکنولوژی و طراحی فوق العاده آن باعث شد بسیاری از محصولات از آن الهام گرفته و تکنولوژیهایش در آن تکرار شوند و محصولات زیادی با این سبک و مواد اولیه چه توسط آدیداس یا برند های دیگر تولید شوند بالاخره سوپراستار به خیابان ها هم راه یافت و این همان زمانیست که این مدل تاثیر ماندگار خود را در این صنعت و فرهنگ مردم به جای گذاشت.</p><p class=\"ql-align-justify\">می توان گفت سوپر استار احیا کننده نام آدیداس در تمام ایالات متحده آمریکا بود.</p><p class=\"ql-align-justify\">در دهه 1980 کفش های ترینر به روی صحنه ها راه یافتند . گروه هیپ هاپ D.M.C آن ها را بدون بند با زبانه باز پوشیده و در پاسخ به آهنگ Felon Sneakers  آهنگ My Adidas را منتشر و به روی صحنه بردند.</p><p class=\"ql-align-justify\">از آن زمان به بعد، این شروع یکی از موفق‌ترین هم‌کاری‌های غیر منتظره موسیقی در مد بود. این اولین باری بود که یک مارک ورزشی برای بازاریابی محصول خود از موسیقی استفاده می‌کرد.<span style=\"background-color: rgb(255, 255, 255); color: rgb(119, 119, 119);\">کفش Superstar تبدیل به بخشی از مد جوانان شده‌است و اکنون به جای ورزش به طور منظم به عنوان یک کتونی همه جا پوش استفاده می‌شود. این محصول هم مانند آل استار شرکت کانورز کار خود را از زمین های بسکتبال شروع کرد و به خیابان ها راه یافت .البته که توانایی طراحان آدیداس در تعامل با جنبش های مد و فرهنگ سازی در میان جوانان انکار ناپذیر است و امروزه سوپر استار به عنوان یک کفش کلاسیک آدیداس جایگاه مهمی در مجموعه ست های مد و لباس دارد.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-center\"> </p><p><br></p>', '2023-04-12 12:54:08', '2025-07-03 07:54:39'),
