(1257, 'کفش روزمره نایک زنانه رنگ خاکی مدل جردن فور کاز', 'nike-everydey-shoes-AIR-JORDAN-4-RETRO-KAWS-codl-grey-whiten', '930155003', 'Dtc25fZFdp_01.jpg,rTJ0M5ha4n_03.jpg,p8ncuE4MBt_04.jpg,qHuehMMLWC_05.jpg,C1yAntSpsC_02.jpg', NULL, NULL, 1, 12, 3, NULL, NULL, '<p class=\"ql-align-justify\">درست در سال 1989 میلادی بود که مایکل جردن برای اولین بار اولین نسخه از سری کفش های <strong>ایر جردن 4</strong> را در یک بازی بسکتبال پوشید و در همان روز بود این سری بی نظیر و پرطرفدار نایک توسط <strong>مایکل جردن</strong> به جهان معرفی شد.</p><p class=\"ql-align-justify\">اگر نگاه اجمالی به این کفش داشته باشید متوجه می شوید که این کفش تشابه زیادی به سری <strong>ایر جردن 3</strong> و <strong>کورتساید 23</strong> دارد. اگر این طور فکر میکنید کاملاً درست متوجه شده اید، DNA اصلی این <strong>کتانی بسکتبالی</strong> و نایک ایر جردن کورتساید 23 از سری جردن 3 گرفته شده است.</p><p class=\"ql-align-justify\">بزرگ ترین ویژگی <strong>کفش کتونی نایک</strong> ایر جردن 4 رترو که در تمام نسخه ها و رنگ هایی که از این کفش تا به امروز تولید شده دیده می شود پارچه مش زبانه و دور تا دور زبانه کفش می باشد. این پارچه مش مسئولیت اصلی ایجاد گردش هوا و تنفس پذیری پا درون کفش را بر عهده دارند.</p><p class=\"ql-align-justify\"><strong>کفش اسپرت نایک ایر جردن 4 رترو</strong> یکی از قدیمی ترین و خاص ترین طراحی هایی است که نایک و مایکل جردن تا به امروز طراحی و معرفی کرده اند. این طراحی جزو پر طرفدار ترین ورژن هایی می باشد که تا به امروز از سری ایر جردن معرفی شده است تا حالا نزدیک به 300 رنگ و مدل مختلف از طراحی و معرفی شده است.</p><p class=\"ql-align-justify\">این سری نایک یک سری رسم و رسومی دارد که در تمام نسخه های میتوانید آن ها را مشاهده کنید و برای اینکه این ویژگی ها را بهتر بشناسید به جزئیات به آن ها در ادامه میپردازیم.</p><p class=\"ql-align-justify\"><strong>نایک</strong> برای اینکه قدرت و توان بهتر فیت شدن رویه کفش روی پای شما را تقویت کند و همچنین از فشار هایی که بر اثر محکم بستن بیش از حد بند ها جلوگیری کند برای اولین و آخرین درگاه بند ها از دو قطعه پلاستیکی استفاده کرده است.</p><p class=\"ql-align-justify\">این دو قطعه علاوه بر اینکه فشار وارده بر رویه، درگاه بند ها و خود بند ها را تا حد خیلی زیادی کاهش می دهد، ظاهر چشم نوازی را برای این کفش ایجاد کرده است که به نوبه خود ویژگی منحصر به فردی است که در هیچ کدام از سری های قبلی آن را ندیده بودیم.</p><p class=\"ql-align-justify\">نایک این <strong>کتانی مردانه و زنانه</strong> را به شکل اعجاب انگیزی قدرتمند و محکم طراحی کرده است. طراحان نایک برای این که عمر و استقامت این کفش را تا حد خیلی زیادی تقویت کند چند ویژگی خیلی کلیدی را به این کفش اضافه کرده است.</p><p class=\"ql-align-justify\">به عنوان مثال نایک برای مرز ارتباط زیره میانی و رویه از یک تکه پلاستیک فشرده فوق قدرتمند استفاده کرده است که به هیچ عنوان نمیگذارد بر اثر فشار های احتمالی رویه کفش از این بخش پاره شود.یا در بخش کناری مچ پا از دو تکه ی مثلثی شکل استفاده شده که آن دو قطعه ای که به عنوان محافظ درگاه بند ها در نظر گرفته شده بود به این دو بخش مثلثی شکل متصل شده است و نمیگذارند تمام فشار وارده فقط بر روی آن دو قطعه باشد.</p><p class=\"ql-align-justify\">علاوه بر آن این دو قطعه مثلثی شکل تاثیر زیادی بر ایستایی هر چه بهتر این کفش میگذارند و همچنین باعث افزایش عمر و دوام رویه این کفش می شوند.</p><p class=\"ql-align-justify\">بخش پشتی پاشنه این <strong>کفش اسپرت</strong> هم از این سپر های محافظ و تقویت کننده عمر کفش خالی نمانده و نایک از یک سپر خیلی مقاوم برای این بخش استفاده کرده است.</p><p class=\"ql-align-justify\">در تمام نسخه های سری کفش ایر جردن 4 این بخش در نظر گرفته شده است و لوگوی مایکل جردن یا همان Jump Man قرار داده شده است.</p><p class=\"ql-align-justify\">محافظ پشتی پاشنه و دور مچ پا توانایی زیادی برای جلوگیری از پیچ خوردن یا آسیب دیدن پای شما دارند و نمیگذارند به آسانی خطری شما را تحدید کند که به خودی خود مزیت خیلی بزرگی می باشد.</p><p class=\"ql-align-justify\">یکی دیگر از ویژگی های سری ایر جردن 4 زیره میانی قدرتمند و فوق العاده ای است که برای آن در نظر گرفته شده است.</p><p class=\"ql-align-justify\">کتانی نایک ایر جردن 4 رترو هم از این ویژگی برخوردار است. کپسول هوایی که برای این کفش در نظر گرفته شده است یکی از راحت ترین و توانمند ترین کپسول های هوایی می باشد که تا به حال در کفش های نایک به کار گرفته شده است و تشابه زیادی به ایر (Air) به کار رفته در کفش کورتساید 23 دارد.</p><p class=\"ql-align-justify\">این کپسول هوا زیر پاشنه پا قرار گرفته است و توانایی جذب و انتقال انرژی بی نظیری دارد. دیواره ها و ستون میانی این کپسول هوا آن قدر قدرتمند است و به حدی تقویت شده است که جای هیچ نگرانی را برای ورزش های سنگینی مثل بسکتبال نگذاشته است.</p><p class=\"ql-align-justify\">در ادامه زیره میانی از فوم EVA استفاده شده است که علاوه بر اینکه دوام خیلی بالایی دارد، از انعطاف پذیری و راحتی منحصر به فردی هم برخوردار است که حس راحتی در این کفش را کامل میکند.</p><p class=\"ql-align-justify\">در بخش زیره خارجی این <strong>کتونی اسپورت</strong> از یک زیره و لاستیک (Rubber) تخت با عاج و دندانه های بزرگ و کوچکی استفاده شده است که در جهت و زاویه های مختلفی قرار گرفته اند. این عاج ها یکی از چسبنده ترین زیره های خارجی را تشکیل داده اند و توانایی ایست و گریپ بی نظیری دارند.</p><p class=\"ql-align-justify\">در بخش میانی این زیره خارجی نماد و لوگو مایکل جردن قرار گرفته است که با رنگ متفاوت بر روی کفش حک شده است.</p><p class=\"ql-align-justify\">خوب از این ها که بگذریم و اگر بخواهیم به جزئیات این نسخه از سری ایر جردن 4 بپردازیم که در ماه اکتوبر سال 2022 میلادی معرفی شد بپردازیم می بایست در مورد رویه و رنگ بندی آن صحبت کنیم.</p><p class=\"ql-align-justify\">رویه کفش نایک ایر جردن 4 رترو از سه پارچه مش برای زبانه و ایجاد گردش هوا، پارچه چرمی برای محافظ و سپر نیم جلویی کفش و از پارچه مخمل برای لایه زیرین و اولیه این کفش استفاده شده است</p><p class=\"ql-align-justify\">در انتها اگر به دنبال یک کفش اسپرت یا یک <strong>کفش بسکتبالی</strong> حرفه ای از برند نایک میگردید که برای ورزش، باشگاه، استایل های کلاسیک و کژوال بتوانید آن را بپوشید که استایل و رنگ بندی خاصی هم داشته باشد، این کفش یعنی نایک ایر جردن 4 رترو بهترین گزینه برای شما می باشد.</p><p class=\"ql-align-justify\"><br></p><p><br></p>', '2023-08-21 07:41:03', '2024-11-17 14:12:09'),
