(1260, 'کفش روزمره زنانه ایر جردن سفید آبی AIR JORDAN 1 LOW (blue white )', 'کفش-روزمره-زنانه-ایر-جردن-سفید-آبیAIR-JORDAN-1-LOW-(blue-white-)', 'DV1299104QB-229', 'OyRtnlh6Pp_IMG_6060.jpeg', NULL, NULL, 1, 12, 3, NULL, NULL, '<p><br></p>', '2023-08-21 07:56:33', '2025-02-17 15:16:09'),
(1261, 'کفش روزمره زنانه ایر جردن سفید مشکی AIR JORDAN 1 LOW (black white )', 'کفش-روزمره-زنانه-ایر-جردن-سفید-مشکیAIR-JORDAN-1-LOW-(black-white-)', 'DH6931001QD-177', 'i2GRBl9Qlp_01.jpg,ARSprc4Bzj_03.jpg,ZdMvBvwy08_04.jpg,A8eKX0l5AC_05.jpg,X4JoHq8n5s_02.jpg', NULL, NULL, 1, 12, 3, NULL, NULL, '<p><br></p>', '2023-08-21 08:00:14', '2023-09-22 09:19:43'),
