(1263, 'کفش روزمره زنانه نایک ایرمکس پلاس سبز نارنجی NIKE AIR MAX PULSE (white-light green )', 'کفش-روزمره-زنانه-نایک-ایرمکس-پلاس-سبز-نارنجی-NIKE-AIR-MAX-PULSE-white-light-green', 'DR0453 013', 'XMIABXfYMh_01.jpg,yH0AKdJ3ie_03.jpg,LjMgpaKOCR_04.jpg,Yh6VxNybxW_05.jpg,mMljDoTg5W_02.jpg', NULL, NULL, 1, 12, 5, NULL, NULL, '<p><br></p>', '2023-08-21 08:07:02', '2023-10-29 16:33:39'),
(1264, 'کفش روزمره نایک زنانه رنگ کرم مدل ایر جردن میلان ساقدار', 'nike-everydey-shoes-air-jordan-high-milan', 'CV3044 100 QB-62', 'xNElRsbflq_IMG_6061.jpeg', NULL, NULL, 1, 12, 3, NULL, NULL, '<p class=\"ql-align-justify\">هر زمان حرف از <strong>نایک ایر جردن</strong> 1 می شود هر کسی با توجه به سلیقه ای که دارد یاد یک رنگ جذابی از این سری پرطرفدار نایک می افتاد.</p><p class=\"ql-align-justify\">ولی وقتی حرف از نسخه های دخترانه یا زنانه سری ایر جردن 1 می شود رنگ بندی کرم یاقهوه ای آن همیشه برای ست های دخترانه گزینه فوق العاده ای بوده که در بین این جنسیت از طرفداران نایک محبوبیت خاصی دارد.</p><p class=\"ql-align-justify\">این نسخه از سری کفش های ایر جردن 1 با همان سبک و سیاق همیشگی با یک رنگ بندی فوق العاده که جزو خاص ترین رنگ بندی هایی است که تا به حال نایک تولید کرده که جذابیت فوق العاده دارد و با تغییر یک سری جزئیات این جذابیت را دو چندان کرده است و به استایل شما رنگ و طرح متفاوتی را ارائه میکند.</p><p class=\"ql-align-justify\">بر روی نایک ایر جردن 1 مید دخترانه هم همان امضای تمام کفش های ایر جردن وجود دارد و طبق معمول همان آرم بال های معروف روی این کفش هم می باشد که با همان سبک و سیاق همیشگی روی بخش بیرونی مچ پا حک شده است که جذابیت خاص خودش را دارد.</p><p class=\"ql-align-justify\">تفاوت اصلی نایک ایر جردن 1 مید با دیگر نسخه های ایر جردن 1 در روی آن است که بر خلاف همیشه که رویه این کفش تمام چرم است ولی در این نسخه در قسمت پنجه کفش از چرم نبوک استفاده شده است که کیفیت فوق العاده بالایی دارد و در کنار این ها از تنفس پذیری بیشتری هم برخوردار است.</p><p class=\"ql-align-justify\">روی چرم بخش پشتی پاشنه از طرح توپ بسکتبال استفاده شده است که با رنگ قهوه ای پر رنگ تری کار شده که با لمس کردن روی آن حس فوق العاده ای به شما منتقل می شود. پارچه زیر این چرم از جنس خاصی با طرح های خطی تشکیل شده است که تا به حال توی هیچ نسخه ای از کفش های ایر جردن ندیده اید.</p><p class=\"ql-align-justify\"><strong>کفش کتانی نایک</strong> ایر جردن 1 مید مثل تمام کفش های ایرجردن زیره میانی و خارجی از جنس لاستیک انعطاف پذیر و راحتی تولید شده است که با بالشتک گذاری فوق العاده ای که در بخش زیره میانی در نظر گرفته شده است حس راحتی فوق العاده ای را در حین استفاده و پیاده روی به شما منتقل میکند.</p><p class=\"ql-align-justify\">بر روی زیره خارجی کفش اسپرت نایک ایرجردن 1 مید امضای نایک با همان آرم و سبک سیاق معروف خود قرار داده شده است و از عاج های بسیار محکم و قدرتمندی استفاده شده است که کمک شایانی به چسبندگی و استقامت کفش میکند.</p><p class=\"ql-align-justify\">این زیره خارجی از دوام و عمر بالایی برخوردار است که میتوانید آن را سال های سال بپوشید و از آن لذت ببرید.</p><p class=\"ql-align-justify\">در نهایت باید بگوییم که کفش اسپرت نایک ایر جردن 1 مید با رنگ بندی و استایلی که دارد یک کفش بی نظیر برای استایل های دخترانه شماست که میتوانید با پوشیدن و ست کردن لباس هایتان با این کفش یک استایل بی نظیر و خاص را به نمایش بگذارید که تا به حال کسی ندیده باشد.</p><p><br></p>', '2023-08-21 08:10:59', '2025-02-17 15:40:15'),
(1265, 'کفش روزمره نایک زنانه رنگ طوسی سفید لوگو بنفش مدل ایر جردن میلان ساقدار', 'nike-evertydey-shoes-white/color-logo-violet-air-jordan-high', '553558 040 QB-139', '86BNOFwVJV_01.jpg,yv54nHxLTU_03.jpg,H0lKFcnbNX_04.jpg,Foiluit2sr_05.jpg,SLEPD5QtWc_02.jpg', NULL, NULL, 1, 12, 3, NULL, NULL, '<p class=\"ql-align-justify\">هر زمان حرف از <strong>نایک ایر جردن</strong> 1 می شود هر کسی با توجه به سلیقه ای که دارد یاد یک رنگ جذابی از این سری پرطرفدار نایک می افتاد.</p><p class=\"ql-align-justify\">ولی وقتی حرف از نسخه های دخترانه یا زنانه سری ایر جردن 1 می شود رنگ بندی سفید یا خاکستری آن همیشه برای ست های دخترانه گزینه فوق العاده ای بوده که در بین این جنسیت از طرفداران نایک محبوبیت خاصی دارد.</p><p class=\"ql-align-justify\">این نسخه از سری کفش های ایر جردن 1 با همان سبک و سیاق همیشگی با یک رنگ بندی فوق العاده که جزو خاص ترین رنگ بندی هایی است که تا به حال نایک تولید کرده که جذابیت فوق العاده دارد و با تغییر یک سری جزئیات این جذابیت را دو چندان کرده است و به استایل شما رنگ و طرح متفاوتی را ارائه میکند.</p><p class=\"ql-align-justify\">بر روی نایک ایر جردن 1 مید دخترانه هم همان امضای تمام کفش های ایر جردن وجود دارد و طبق معمول همان آرم بال های معروف روی این کفش هم می باشد که با همان سبک و سیاق همیشگی روی بخش بیرونی مچ پا حک شده است که جذابیت خاص خودش را دارد.</p><p class=\"ql-align-justify\">تفاوت اصلی نایک ایر جردن 1 مید با دیگر نسخه های ایر جردن 1 در روی آن است که بر خلاف همیشه که رویه این کفش تمام چرم است ولی در این نسخه در قسمت پنجه کفش از چرم نبوک استفاده شده است که کیفیت فوق العاده بالایی دارد و در کنار این ها از تنفس پذیری بیشتری هم برخوردار است.</p><p class=\"ql-align-justify\">روی چرم بخش پشتی پاشنه از طرح توپ بسکتبال استفاده شده است که با رنگ سفید و خاکستری پر رنگ تری کار شده که با لمس کردن روی آن حس فوق العاده ای به شما منتقل می شود. پارچه زیر این چرم از جنس خاصی با طرح های خطی تشکیل شده است که تا به حال توی هیچ نسخه ای از کفش های ایر جردن ندیده اید.</p><p class=\"ql-align-justify\"><strong>کفش کتانی نایک</strong> ایر جردن 1 مید مثل تمام کفش های ایرجردن زیره میانی و خارجی از جنس لاستیک انعطاف پذیر و راحتی تولید شده است که با بالشتک گذاری فوق العاده ای که در بخش زیره میانی در نظر گرفته شده است حس راحتی فوق العاده ای را در حین استفاده و پیاده روی به شما منتقل میکند.</p><p class=\"ql-align-justify\">بر روی زیره خارجی کفش اسپرت نایک ایرجردن 1 مید امضای نایک با همان آرم و سبک سیاق معروف خود قرار داده شده است و از عاج های بسیار محکم و قدرتمندی استفاده شده است که کمک شایانی به چسبندگی و استقامت کفش میکند.</p><p class=\"ql-align-justify\">این زیره خارجی از دوام و عمر بالایی برخوردار است که میتوانید آن را سال های سال بپوشید و از آن لذت ببرید.</p><p class=\"ql-align-justify\">در نهایت باید بگوییم که کفش اسپرت نایک ایر جردن 1 مید با رنگ بندی و استایلی که دارد یک کفش بی نظیر برای استایل های دخترانه شماست که میتوانید با پوشیدن و ست کردن لباس هایتان با این کفش یک استایل بی نظیر و خاص را به نمایش بگذارید که تا به حال کسی ندیده باشد.</p><p><br></p>', '2023-08-21 08:17:48', '2024-11-17 14:08:27'),
(1266, 'کفش روزمره نایک رنگ سفید طوسی مدل ایر جردن لو', 'nike-everydey-white/grey-color-air-jordan-1-mid-low', 'DC0774 105 QB-134', 'uVN8Q9CWtC_01.jpg,ZGZeOEhB4g_02.jpg,haBL89IxG8_03.jpg,Fn0a6bQ01d_04.jpg', NULL, NULL, 1, 4, 3, NULL, NULL, '<p class=\"ql-align-justify\"><strong>کفش اسپرت نایک ایر جردن 1</strong> لو پاریس یک کفش فوق العاده کلاسیک و جذاب است که کیفیت فوق العاده بالایی و برای هر سبک استایلی مناسب می باشد. این کتونی یکی از زیبا ترین رنگ بندی های حال حاضر این سری از کفش های نایک را دارد و از همین رو هم طرفدار بسیار زیادی در بین مخاطبان دارد.</p><p class=\"ql-align-justify\">زمانی که حرف از <strong>کفش اسپرت</strong> و <strong>کفش کلاسیک</strong> می‌شود، این نایک ایر جردن 1 لو است که همیشه پرچمدار این دسته بوده و خلاقیت طراحان این برند زبان‌ زده تمام دنیا بوده. طراحان این برند با ذهن خلاق خود، کفش‌ های زنانه منحصر به فرد و خاصی را متناسب با هر سلیقه‌ای طراحی و تولید کرده اند.</p><p class=\"ql-align-justify\">نایک ایر جردن 1 لو پاریس، یکی از جدیدترین طرح هایی است که نایک معرفی کرده و همه مخاطبان و استایلیست‌ها را شگفت‌ زده کرده. در طراحی و رنگ‌ بندی این<strong> کفش زنانه</strong>، الهام گرفته شده است از طراحی معماری و حس و حال شهر پاریس که به نوبه خود ویژگی جذابی به نظر می‌رسد.</p><p>این <strong>کفش اسپرت</strong> از سری کفش‌های ایر جردن 1 لو، با همان استایل و طراحی سنتی این کفش تولید شده است. جزئیات و ریزکاری‌هایی که در این کفش به کار رفته است، با ترکیب رنگی که برای آن در نظر گرفته شده، جذابیت و زیبایی خاصی را به خود اضافه کرده است. این کتونی با داشتن استایل اسپرت و مدرن، برای فعالیت‌های پیاده‌روی و روزمره مناسب است.رنگ‌بندی این کفش شامل سفید، خاکستری و طوسی است و از جنس چرم و نبوک تهیه شده است. این ویژگی‌ها باعث می‌شود که این کفش یک کفش فشن و کلاسیک باشد و شما با هر سبک و استایلی که دوست دارید، بتوانید به راحتی این کفش را با لباس‌هایتان ست کنید.</p><p>در بخش پشتی پاشنه، از یک تکه چرم بسیار محکم استفاده شده که با نخی فوق‌ العاده با کیفیت دوخته شده است و به لایه‌های زیرین متصل کرده. این موضوع باعث می شود استقامت و دوام این کفش در طولانی تا حد خیلی چشم گیری افزایش پیدا کند.</p><p>در نایک ایر جردن 1 پاریس نیز همان نماد معروف سری <strong>ایر جردن</strong> مشاهده می‌شود. این نماد از یک توپ با بال‌های بزرگ دور تا دور آن تشکیل شده است. در اکثر کفش‌های سری ایر جردن، این نماد را در شکل و شمایل‌های مختلف می‌توانید مشاهده کنید.</p><p class=\"ql-align-justify\">برای افزایش استقامت این <strong>کفش چرمی</strong>، طراحان نایک از یک تکه پارچه نبوک فوق‌العاده با کیفیت در بخش جلویی کفش استفاده کرده‌اند. این تکه پارچه نه‌ تنها از ورود آسیب به کفش جلوگیری می‌کند، بلکه به استحکام و ثبات کفش نیز کمک می‌کند.<strong>کفش کتانی نایک</strong> ایر جردن 1 لو پاریس، همانند سایر مدل‌ های ایر جردن، دارای یک زیره میانی و خارجی یکپارچه است که از یک لاستیک انعطاف‌پذیر و بسیار راحت تولید شده.</p><p class=\"ql-align-justify\">با بالشتک گذاری و پد گذاری حرفه‌ای که در سرتا سر زیره میانی برای آن در نظر گرفته شده است، نایک احساس راحتی بی‌نظیری را در حین پیاده‌روی و یا حتی استفاده روزمره و طولانی با این کفش به شما منتقل می‌کند.</p><p class=\"ql-align-justify\">زیره خارجی کتانی نایک ایر جردن 1 لو پاریس، از تعداد زیادی عاج و حفره‌های بزرگ و کوچک تشکیل شده که طراحی آن مشابه دیگر نسخه‌های این سری از کفش‌های نایک است.</p><p class=\"ql-align-justify\">این عاج ها که از جنس لاستیک بسیار مستحکم و پایدار تولید شده‌اند، قدرت چسبندگی و انعطاف‌پذیری بسیار بالایی دارند و به هیچ عنوان به پای شما اجازه نمی‌دهند به آسانی در سطوح لغزنده سربخورید.</p><p class=\"ql-align-justify\">در انتها اگر به دنبال یک کفش شیک و زیبا با رنگ بندی جذاب و متفاوت میگردید که کیفیت بالایی داشته باشد و به راحتی آن را با هر سبک لباس و استایلی ست کنید، <strong>کفش اسپورت ایر جردن 1 لو پاریس</strong> بهترین گزینه برای شما می باشد.</p><p class=\"ql-align-justify\"><br></p><p><br></p>', '2023-08-21 08:20:35', '2024-11-17 14:06:25'),
