(2, 5, 'راهنمای کتونی نایکی', '<h3>راهنمای سایز کفش&zwnj;های نایک</h3>\r\n<p>لطفا طول پا را اندازه گیری کنید. سپس با مقایسه اندازه های خود با جدول سایز ارائه شده، سایز مناسب خود را انتخاب نمایید.</p>\r\n<h4>جدول سایز:</h4>\r\n<p>لطفا طبق روش اندازه گیری ارائه شده سایز مناسب خود را از جدول زیر انتخاب نمایید</p>\r\n<ul>\r\n<li>\r\n<p>اندازه های ارائه شده در جدول زیر +/- ۱ سانتی متر دارای خطا می باشد</p>\r\n</li>\r\n<li>\r\n<p>تمامی اندازه ها به سانتی متر می باشد</p>\r\n</li>\r\n</ul>\r\n<table style=\"border-collapse: collapse; width: 50%; height: 167.222px; border-width: 1px; background-color: rgb(206, 212, 217); margin-left: auto; margin-right: auto;\" border=\"1\"><colgroup><col style=\"width: 50.039%;\"><col style=\"width: 50.039%;\"></colgroup>\r\n<tbody>\r\n<tr style=\"height: 23.8889px;\">\r\n<td style=\"border-width: 1px; height: 23.8889px; text-align: center;\"><strong><span style=\"font-size: 14pt;\">سایز</span></strong></td>\r\n<td style=\"border-width: 1px; height: 23.8889px; text-align: center;\"><strong><span style=\"font-size: 14pt;\">طول کف پا</span></strong></td>\r\n</tr>\r\n<tr style=\"height: 23.8889px;\">\r\n<td style=\"border-width: 1px; height: 23.8889px; text-align: center;\"><strong><span style=\"font-size: 14pt;\">40</span></strong></td>\r\n<td style=\"border-width: 1px; height: 23.8889px; text-align: center;\"><strong><span style=\"font-size: 14pt;\">25.5</span></strong></td>\r\n</tr>\r\n<tr style=\"height: 23.8889px;\">\r\n<td style=\"border-width: 1px; height: 23.8889px; text-align: center;\"><strong><span style=\"font-size: 14pt;\">41</span></strong></td>\r\n<td style=\"border-width: 1px; height: 23.8889px; text-align: center;\"><span style=\"font-size: 14pt;\"><strong>26.5</strong></span></td>\r\n</tr>\r\n<tr style=\"height: 23.8889px;\">\r\n<td style=\"border-width: 1px; height: 23.8889px; text-align: center;\"><strong><span style=\"font-size: 14pt;\">42</span></strong></td>\r\n<td style=\"border-width: 1px; height: 23.8889px; text-align